(1, 'Affordable education at your convenience', 'about//about_us_522372.png', '<h3><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Being avid learners themselves, our founders realized how pricey is the\r\neducation scenario, and how the priority of entities in the education vertical\r\nshould emphasize on making quality education affordable. Hence, “<b>UpSkill</b>”\r\nno-nonsense, to-the-point education at your convenience.</span><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p></h3><ul>\r\n                            </ul>', 1, '2019-08-16 18:01:02', '2019-08-30 17:50:00', NULL);
INSERT INTO `about_us_page` (`id`, `title`, `image`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'About Us', 'about//about_us_214904.jpg', '<h3><p style=\"text-align:justify;mso-outline-level:4\"><b><span style=\"font-size: 10pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Upskill Educator</span></b><span style=\"font-size: 10pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;is an\r\nonline training platform that provides most affordable and updated information,\r\nknowledge, updates, regulations to professionals across industries. The\r\ntraining sessions are designed and developed by leading subject matter experts\r\nand industry veterans, helping learners to upgrade their knowledge and brush up\r\ntheir skills. Training\'s include the latest regulatory changes, compliance\'s to\r\nexisting regulations, day-to-day business, operational, software, technology\r\nand creative skills to achieve personal, professional and organizational goals.</span></p><p style=\"text-align:justify;mso-outline-level:4\"><span style=\"font-family: Arial, sans-serif; font-size: 10pt;\">With our webinars and online\r\ntraining modules, you can have an incredible learning experience right at your\r\noffice or home. To enable that, you just need a device – smart phone, laptop,\r\ndesktop, i-pad, projector – with Internet connection. Now, you are all set to\r\nget the required knowledge from the comfort of your home or office at a time of\r\nyour convenience.</span></p><p style=\"text-align:justify;mso-outline-level:4\"><span style=\"font-family: Arial, sans-serif; font-size: 10pt;\">We thrive to bring the most updated\r\ninformation at the most affordable price with the aim to extend the benefit to\r\nmaximum audience. We bridge the gap from the information provider to seeker\r\nwith the help of technology and enable professionals get the information\r\npromptly with the ease to access from anywhere, anytime and achieve their\r\npersonal and professional goals.</span></p><p style=\"text-align:justify;mso-outline-level:4\">\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">In addition, Upskill Educator also provides on-site/ custom training\'s for\r\norganizations on request. You can visit Enterprise Plan&nbsp;for details or can write us on support@upskilleducator.com.</span><br></p></h3><ul>\r\n                            </ul>', 1, '2019-08-16 18:01:02', '2020-08-26 14:41:49', NULL);
