(1, 1, '<h3><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\">Upskill Educator</span><br></h3>\r\n<div><span class=\"fa fa-map-marker\" style=\"font-size: 15px; color: rgb(51, 51, 51);\"></span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">&nbsp;</span><span style=\"font-size: 11pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1414, 154th Ave NE APT 4404 Bellevue,&nbsp;</span><span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">WA 98007-4582,&nbsp;USA</span></span><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><div class=\"contact\" style=\"color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><p style=\"margin-bottom: 10px;\"><span class=\"fa fa-phone\"></span>&nbsp;Toll free: +1 888-407-9644</p><p style=\"margin-top: 0px; margin-bottom: 10px;\"><span class=\"fa fa-envelope-o\"></span>&nbsp;E-mail:&nbsp;<span style=\"font-family: Helvetica, sans-serif; font-size: 11.5pt;\">support@upskilleducator.com</span></p><p style=\"margin-top: 0px; margin-bottom: 10px;\"><span class=\"fa fa-clock-o\" aria-hidden=\"true\"></span>&nbsp;Working Hours: Mon-Fri&nbsp;<br>&nbsp;(8.00 am to 5.00 pm PST)</p></div></div>', 1, NULL, '2020-10-14 22:36:40', NULL),
(2, 2, '<p class=\"accordion\">Q1. What is an Audio conference or Webinar?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Audio Conferencing is an excellent tool for education/training – all it takes is a phone and a good internet connection. It’s a product to enable anywhere, anytime learning for skill enhancement.\r\nWith Audio Conferencing you can listen to industry experts from the convenience of your office, home or on a mobile phone. You can get business enhancing information – without the cost, time and stress involved in travelling.\r\n</div>\r\n\r\n\r\n<p class=\"accordion\">Q2. I can’t make the event at the scheduled time. Can I transfer my event to a colleague or view the event at a later time?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. If for any reason you are unable to attend the session at the scheduled time, you can transfer your event by sending an email to support@upskilleducator.com. All our webinar events are recorded and made available online. If you’d like to view the missed event, call us at 1-888-866-9003, and we will make the necessary arrangements. With Live webinar, we recommended to purchase the recording of the webinar by calling us at 1-888-407-9644 and the recording would be available under your account for a year.\r\nRemember to provide the participant’s name and contact details, so we can get in touch with them.\r\n</div>\r\n\r\n\r\n\r\n<p class=\"accordion\">Q3. What if the time and the date of conference don’t suit me?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. You can certainly opt for Recordings of these conferences or purchase the conference transcripts (if available in PDF format). You can also request for a replay of the audio conference on any date convenient to you through On-Demand option – all you need to do is choose On-Demand option while purchasing the webinar or contact our customer care/toll free no. at +1-888-407-9644&nbsp; .</div>\r\n\r\n\r\n\r\n<p class=\"accordion\">Q4. How long will it take to receive my Recordings?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Recordings of webinars are made available under my account section within 7-10 days after the live program takes place. Please be sure you have provided a valid email address when ordering to ensure/validate your login credentials.</div>\r\n\r\n\r\n\r\n<p class=\"accordion\">Q5. How do I register for an audio conference?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Once you have selected the event, there are multiple easy ways to register for the event;\r\nYou can register for an event online through www.upskilleducator.com site under ‘Training’ tab. You can call our customer care at 1-888-407-9644 and register for the event. You can email to customer care at support@upskilleducator.com</div>\r\n\r\n\r\n\r\n<p class=\"accordion\">Q6. What type of equipment do I need?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. All you need is a regular telephone—with speakerphone. And a good internet connection.</div>\r\n\r\n\r\n\r\n<p class=\"accordion\">Q7. Can more than one person listen to the audio conference?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Your registration entitles one person to listen from one phone line as your log-in details are unique. If you have more than one employee listening, you can choose our Group Package options on our checkout page for registering multiple attendees group at attractive discounted price. Similarly, if you have employees attending from multiple locations using multiple phone lines, please order for additional registrations.</div>\r\n\r\n\r\n<p class=\"accordion\">Q8. When will I receive my program materials and dial-in information?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. 24 hours prior to the audio conference, registered participants will receive an e-mail with detailed instructions to access the program, including the phone number to call on the day of the audio conference. Also, you’ll receive a web address where you can download the conference material, or the presentation handouts can be shared over emails as well from the company’s support team.</div>\r\n\r\n\r\n<p class=\"accordion\">Q9. Can I ask detailed customised questions after the conference is over?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. We discourage additional questions after the completion of webinar. We will try to accommodate your query during Q/A session at the end of webinar; however you may also raise one additional question over email for the speaker. Any descriptive and real business case question can be asked for a fee.</div>\r\n\r\n\r\n<p class=\"accordion\">Q10. What happens if I have technical problems during the call?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. In case of any technical problem you can call our customer support at 1-888-407-9644 and ask for the assistance. In case any technical problem occurs from our end, we will reschedule the conference to some other date and time and you will be informed.</div>\r\n\r\n\r\n<p class=\"accordion\">Q11. In case I am not able to attend a live event, then what?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. We will replay the audio conference for you on date and time convenient to you or share the recordings so that you don’t miss. All you need to do is – contact our customer support.</div>\r\n\r\n\r\n<p class=\"accordion\">Q12. Are all conferences CEU approved?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. CEU approval for webinars is specific to webinars eligibility as per requirements from CEU approver institutes and organizations. We publish this information in advance of accepting orders whether a webinar is applicable for CEU. Broadly, our all billing, coding and compliance conferences are CEU Approved.</div>\r\n\r\n\r\n<p class=\"accordion\">Q13. How do I obtain CEU(s) for a live audio conference?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. In case of live audio conference, after the conference is over, you can click on the link sent to you in instructions and download your CEU certificate and Feedback form.</div>\r\n\r\n\r\n<p class=\"accordion\">Q14. How can I get CEU(s) for an on demand / Recording event?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. In case of On-Demand event, after the conference is over, you can click on the link sent to you in instructions and follow the instructions to obtain the CEU. For recording, you may need to pass a Quiz Exam with minimum score criteria before you can be sent the CEU certificate. Exam is not the criteria for live attendees who are auto eligible for CEU.</div>\r\n\r\n\r\n<p class=\"accordion\">Q15. Can I get a customized audio conference for my organization?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Yes, you can contact our customer support and explain your requirements to them.</div>\r\n\r\n\r\n<p class=\"accordion\">Q16. What credit cards do you take?</p>\r\n<div class=\"panel\"><div style=\"text-align: justify;\">A. We accept most of the credit cards, as well as debit cards bearing the Visa/Master Card Logos. Credit and Debit cards are charged at the time the order is placed. For your convenience we accept the following forms of credit card payment:\r\nVisa / MasterCard / American Express / Discover / most other cards in additional cases, we will accept personal and corporate checks on our registered company account/address as will be shared to you at the time of purchase for check payment.&nbsp;</div><div style=\"text-align: justify;\">While no company can insure that transmission of data over the internet is ever fully secure, UpSkill Educator have taken steps to make your credit card transactions as secure as possible by using the most sophisticated encryption technology. We use Stripe and utilize a Secure Socket layering (SSL), which provides the safest internet transmission of your personal information.</div></div>\r\n\r\n\r\n<p class=\"accordion\">Q7. Who should I make my check out to?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Please make checks payable to: Remark Experts LLC, DBA UpSkill Educator or its assignee as will be informed to you by our customer care / Support team, and be sure to include your complete ordering information with your check. Please include a valid mailing address and phone number. Missing information may delay your order from processing.</div>\r\n\r\n<p class=\"accordion\">Q18. What is your cancellation policy?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Cancellations received up to five business days before the seminar are refundable, minus a registration and processing charge of $25 which you may apply toward any future seminar. After that, cancellations are subject to the entire seminar fee, which you may also apply toward a future seminar. Please note that if you don’t cancel and don’t attend, you are still responsible for payment. Substitutions may be made at any time.</div>\r\n\r\n\r\n<p class=\"accordion\">Q19. How can I give feedback?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Please email support@upskilleducator.com. We value every feedback and strive to meet high expectations which are customers demand.</div>\r\n\r\n\r\n<p class=\"accordion\">Q20. Is the registration valid for 1 person only?</p>\r\n<div class=\"panel\" style=\"text-align: justify; \">A. Yes, but you can also register multiple attendees for an audio session. For a discounted price for multiple attendees from one location/office through Group Package on our check out page&nbsp; or please contact support@upskilleducator.com or call 1-888-407-9644.</div>', 1, NULL, '2020-08-31 14:44:02', NULL),
