INSERT INTO `our_speaker` (`id`, `title`, `email`, `phone`, `image`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Dayna Reum CPP FPC', 'daynaprtraining@live.com', '623-332-9932', 'speaker//speaker_653269.jpg', 'Dayna is currently the Director of Payroll Operations at Ann & Robert Lurie Children’s Hospital of Chicago. Dayna has been heavily involved in the payroll field over 17 years. Starting as a payroll clerk at a small Tucson company, Dayna moved on to be a Payroll Team Leader at Honeywell Inc. During Dayna’s time at Honeywell she obtained her FPC (Fundamental Payroll Certification) through the American Payroll Association. She also received several merit awards for Customer Service and Acquisitions and Divestitures. Dayna is no stranger to teaching she has taught at the Metro Phoenix American Payroll Association meetings and at the Arizona State Payroll Conference. Topics including Payroll Basics, Global/Cultural Awareness, Immigration Basics for the Payroll Professional, Multi-State and Local Taxation and Quality Control for Payroll, International and Canadian payroll. Dayna has her CPP (Certified Payroll Professional) through the APA. She also serves on the National American Payroll Association on the National Strategic Leadership Task Force, Government Affairs Task Force (PA Local tax subcommittee). Dayna has received a Citation of Merit for her service along with being a Gold Pin member of the APA. Besides her payroll accomplishments Dayna is certified in HR hiring and firing practices and is a Six-Sigma Greenbelt.', 0, '2019-08-16 18:01:02', '2020-12-11 22:32:50', NULL),
(2, 'Robert E. McKenzie', 'REMCKENZIE@arnstein.com', '312.876.6927', 'speaker//speaker_250209.png', 'Robert E. McKenzie is a partner of the law firm of Saul Ewing Arnstein & Lehr LLP of Chicago, Illinois, concentrating his practice in representation before the Internal Revenue Service and state agencies. He has lectured extensively on the subject of taxation. From 2009 to 2011, Mr. McKenzie was a member of the IRS Advisory Council, which advises IRS management.', 0, '2019-08-16 18:01:02', '2020-12-11 22:32:40', NULL),
(3, 'Vicky M. Lambert CPP', 'vicki@thepayrolladvisor.com', '702-463-7603 ', 'speaker//speaker_885460.jpg', 'Vicki M. Lambert, CPP is President and  Academic Director of The Payroll Advisor™ a firm specializing in the training of payroll professionals. With over three decades of hands-on experience in all facets of payroll functions as well as over 20 years as a trainer and author, Ms. Lambert is a sought-after and respected voice in the practice and management of payroll issues.', 0, '2019-08-16 18:01:02', '2020-12-11 22:31:48', NULL),
(4, 'Lynn M. Anderanin-CPC', 'landeranin@healthinfoservice.com', '847-720-7090', 'speaker//speaker_117290.jpg', 'Lynn Anderanin, CPC, CPPM, CPMA, CPC-I, COSC, is the Sr. Coding Educator for Healthcare Information Services, a physician’s revenue cycle management company in Chicago. She has over 35 years’ experience in all areas of the physician practice, specializing in Orthopaedics.  Lynn is currently a Workshop and Audio Presenter. She is a former member of the American Academy of Professional Coders (AAPC) National Advisory Board, as well as several other boards for the AAPC. She is also the founder of her Local Chapter of the AAPC.', 1, '2019-08-17 16:04:38', '2020-08-27 20:59:31', NULL),
(5, 'Duane C. Abbey - Ph.D. CFP', 'Duane@aaciweb.com', '1111111111', 'speaker//speaker_612453.png', 'Duane C. Abbey, Ph.D. is a management consultant who specializes in healthcare consulting and related areas. Duane has more than 20 years of experience as a consultant. His consulting engagements revolve around a combination of compliance reviews, chargemaster reviews, APC audits and revenue enhancement for hospitals and hospital systems.', 0, '2019-08-17 16:13:41', '2020-12-11 22:32:10', NULL),
(6, 'Paul Flogstad', 'paul@pmssf.com', '605-413-0436', 'speaker//speaker_130392.jpg', 'Paul has been involved in the real estate industry for the past 38 years. He has been involved in sales, construction, project management, appraisal, mortgage consulting and brokerage, property management and property management consulting/training.\r\n\r\nThrough his consulting company, Property Management Solutions, he provides training and consulting services nationwide to owners, management companies, multi-housing associations, as well as state and federal agencies.\r\n\r\nHe specializes in fair housing issues and has developed fair housing and outreach programs for governmental agencies as well as conducting seminars which are presented to property management companies, apartment associations and the general public. He also conducts research analysis for impediments to fair housing for grantees of federal CDBG funds. \r\n\r\nMost recently, he has been a consultant to the City of Sioux Falls and the State of South Dakota. In this assignment he has developed a fair housing awareness program that is one of the first of its kind in the nation. It involves a three pronged approach to fair housing awareness. This approach makes use of an ombudsman concept and has proven to be very effective in dealing with discrimination and landlord/tenant issues.\r\n\r\nFor over twenty years was involved in appraisal of residential, multi-family, farm and commercial properties throughout the Midwest. Most recently, he was a consultant for affordable, multi-housing properties in 22 different states. This involved properties in HUD, Rural Development, HOME and Tax Credit programs.', 1, '2019-08-23 14:19:39', '2020-09-02 15:54:08', NULL),
(7, 'Natalie Ivey MBA, SPHR, SHRM-SCP', 'natalie@rpchr.com', '561-901-9290 ', 'speaker//speaker_217151.jpg', 'Natalie Ivey, MBA, SPHR, SHRM-SCP is an HR consultant, professional speaker, author, and educator within the HR profession. She has more than two decades of leadership and HR management experience with Fortune 500 organizations and in working as a trusted advisor and consultant to business leaders both in the United States and abroad.', 0, '2019-08-23 14:24:32', '2020-08-22 16:06:53', NULL),
(8, 'Rahul', 'rahul1@yopmail.com', '63958976741', 'speaker//speaker_259774.jpg', 'Test', 0, '2020-08-12 16:54:13', '2020-08-12 16:55:06', NULL),
(9, 'Joel Garfinkle', 'joel@garfinkleexecutivecoaching.com', '510-333-6369', 'speaker//speaker_395730.png', 'Joel Garfinkle has 20 years’ speaking experience as both a keynote speaker and a corporate trainer (joelinspirationalspeaker.com/) Joel’s clients include Oracle, Ritz-Carlton Hotels, Toyota, NBA, Warner Bros and Nestlé. He has written 7 books and more than 300+ articles on leadership, workplace issues and career advancement.\r\nJoel is acknowledged as one of the top-50 executive coaches in U.S. Global Gurus listed him 14th on the list of top-30 global coaching experts. He is a Master Certified Coach (highest accreditation in the profession of coaching from the International Coach Federation). Joel’s speeches and trainings draw on his first-hand experience of working closely with more than 1,800 coaching clients and top executives of these world’s leading companies: Google, Microsoft, Starbucks, Netflix, Deloitte, IBM, NBC Universal and Amazon.', 1, '2020-09-05 16:26:52', '2020-09-05 16:26:52', NULL),
(10, 'Douglas Cohen', 'douglascohen@worldwidetradelaw.com', '602-290-6866', 'speaker//speaker_614735.jpg', 'For more than 20 years, Mr. Douglas Cohen has been at the forefront of international trade and transactions. With senior positions in private practice, the US Department of Commerce, European Union, IATA, and American Airlines, he has developed substantial expertise in international trade compliance, import-export, foreign market entry, and international negotiations. At present, Mr. Cohen is Senior Manager, Global Trade and Contracts, at Worldwide Trade & Legal Consultants, where he provides strategic and legal advice to organizations seeking to enter and expand foreign markets.\r\nMr. Cohen has been asked to teach his expertise at universities and corporate seminars in the US, Europe, Asia, and the Middle East. He is the author of numerous publications on international trade, transactions, and international laws. Mr. Cohen has earned a Juris Doctor degree, a Masters’ degree in International Management, and a Bachelor degree in International Relations.', 1, '2020-09-05 16:32:56', '2020-09-05 16:32:56', NULL),
(11, 'Mike Thomas', 'mike@mthomas.co.uk', '+44 799-059-4062', 'speaker//speaker_743731.jpg', 'Mike Thomas has worked in the IT training business since 1989. He is a subject matter expert in a range of technologies including Microsoft Office and Apple Mac.\r\nIn 2012 Mike founded theexceltrainer.co.uk where he has produced nearly 200 written and video-based Excel tutorials.\r\nHe has recorded several Excel training courses for pluralsight.com and in his career delivered hundreds of courses and webinars on a wide variety of technology-related topics.\r\nMike is a Fellow of The Learning and Performance Institute and has worked with and for a large number of global and UK-based companies and organizations across a diverse range of sectors.\r\nIn addition to training, he also designs and develops Microsoft Office-based solutions that automate key business tasks and processes.', 1, '2020-09-05 16:42:48', '2020-09-05 16:42:48', NULL),
(12, 'Michele L. Davis, CPC', 'MICHEDV1@GMAIL.COM', '(520) 981-7537', 'speaker//speaker_792973.jpg', 'Michele has been in the Tucson Arizona Medical Community since 1983; working in multiple capacities, both clinical, as well as administrative. She has worked at every hospital, nursing home and psych facility in the Tucson area, as well as, several Provider organizations. Her true passion is educating the medical community about the guidelines associated with documentation and coding; most importantly, the correct way to capture the acuity of our patient population using the language of medicine in combination with the language of coding. Historically, she has taught Medical Records, Billing and Coding; was part of the Insurance Management Team for Davita Dialysis, and Healthcare Advocate at Optum. Currently she works at Centene Corporation as a Sr. Risk Adjustment Analyst educating the provider community once again. She additionally has spoken for AAPC local chapters, and AAPC Regional conferences when available. Michele is most proud of being a coding mentor for Tucson\'s coding community.', 1, '2020-09-06 19:17:00', '2020-09-06 19:49:49', NULL),
(13, 'Dr. Susan Strauss', 'susan@straussconsulting.net', '952-937-1991', 'speaker//speaker_373410.jpeg', 'Dr. Susan Strauss is a national and international speaker, trainer and consultant. She has worked as a psychiatric nurse and her undergraduate degree is in psychology and human services. Her specialty areas include discrimination, harassment, and bullying; management/leadership development, and organization development. She conducts harassment and bullying investigations and works as an expert witness for discrimination lawsuits. Susan also trains and consults with business, education, healthcare, law, and government organizations from both the public and private sector.\r\n\r\nDr. Strauss has authored over 30 book chapters, books, and articles in professional journals. She has been featured on 20/20, CBS Evening News, and other television and radio programs as well as interviewed for newspaper and journal articles such as The Times of London, Lawyers Weekly, and Harvard Education Newsletter.\r\n\r\nSusan has presented at international conferences in Botswana, Egypt, Thailand, Israel, Bali, Beirut, and the U.S. She has consulted with professionals from other countries such as England, Australia, Canada, Beirut and St. Maartin, Israel, Bali, and the Middle East. She has her doctorate in organizational leadership, is a registered nurse with a bachelor’s degree in psychology and human services, a master’s degree in community health, and a professional certificate in training and development.', 1, '2020-10-09 17:34:50', '2020-10-12 07:49:41', NULL),
(14, 'Margie Faulk - PHR, SHRM-CP', 'mfaulk@hrcompliance.net', '(407)720-8745', 'speaker//speaker_554737.jpg', 'Margie Faulk is a senior level human resources professional with over 15 years of HR management and compliance experience. A current Compliance Advisor for HR Compliance Solutions, LLC, Margie, has worked as an HR Compliance advisor for major corporations and small businesses in the small, large, private, public, Non-profit sectors and International compliance. Margie has provided small to large businesses with risk management strategies that protect companies and reduces potential workplace fines and penalties from violation of employment regulations. Margie is bilingual (Spanish) fluent and Bi-cultural.\r\n\r\nMargie’s area of expertise includes Criminal Background Screening Policies and auditing, I-9 document correction and storage compliance, Immigration compliance, employee handbook development, policy development, sexual harassment investigations/certified training, SOX regulations, payroll compliance, compliance consulting, monitoring US-based federal, state and local regulations, employee relations issues, internal investigations, HR management, compliance consulting, internal/external audits, and performance management.\r\n\r\nMargie’s unique training philosophy includes providing free customized tools for all attendees. These tools are customized and have been proven to be part an effective risk management strategy. Some of the customized tools include the I-9 Self Audit. Correction and Storage program, Ban the Box Decision Matrix Policy that Employers can provide in a dispute for allegations, Family Medical Leave Act (FMLA) Compliance Guide, Drug-Free Workplace Volatile Termination E-Book and other compliance program tools when attendees register and attend Margie’s training.\r\n\r\nMargie holds professional human resources certification (PHR) from the HR Certification Institution (HRCI) and SHRM-CP certification from the Society for Human Resources Management. Margie is a member of the Society of Corporate Compliance & Ethics (SCCE).', 1, '2020-10-11 21:13:46', '2020-10-11 21:13:46', NULL),
(15, 'William A. Levinson', 'wlevinson@verizon.net', '570-824-1986', 'speaker//speaker_921424.jpg', 'William A. Levinson, P.E., FASQ, CQE is the principal of Levinson Productivity Systems, P.C, which specializes in lean manufacturing, quality management, and industrial statistics. He is also the author of several books on quality, productivity, and management, of which the most recent is The Expanded and Annotated My Life and Work: Henry Ford\'s Universal Code for World-Class Success.', 1, '2020-11-18 21:25:05', '2020-11-18 21:25:05', NULL);
