r\nAnalyst educating the provider community once again. She additionally has\r\nspoken for AAPC local chapters, and AAPC Regional conferences when available.\r\nMichele is most proud of being a coding mentor for Tucson\'s coding community.</span><br></p>', '<h4 style=\"margin-top: 0px; margin-bottom: 15px; padding-top: 5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 300; font-stretch: inherit; font-size: 23px; line-height: 27px; font-family: Exo, Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(7, 16, 65);\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 15.3333px;\">-</span><br></h4>', 0, '2020-09-06 19:36:50', '2020-11-01 23:34:41', NULL),
