(41, 'ded2fffa-84c3-4606-a50d-0a2ddd1ec32d', 1, '0', 4, 1, 'penalty-games-reducing-irs-penalties', 'Penalty Games: Reducing IRS Penalties', 'Robert E. McKenzie', 'products/speaker//speaker_535802.jpg', 'products//products_262588.jpg', 159.00, '2020-11-11 13:00:00', '120', '<p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Each\r\nday the Internal Revenue Service asserts millions of dollars in tax penalties\r\nagainst taxpayers.&nbsp; Many of those penalties are subsequently abated\r\nbecause of quality representation by experienced practitioners.&nbsp; This\r\nclass will cover the basics of supporting reduction of IRS tax penalties.&nbsp;\r\nAfter this class, you should be able to substantially reduce many tax penalties\r\nasserted by the Internal Revenue Service against your clients.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Session highlights:<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repe