; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Accountants<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l2 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333;mso-bidi-language:EN-US\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Tax\r\nCompliance Managers<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l2 level1 lfo2\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333;mso-bidi-language:EN-US\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Other\r\nTax Professionals<o:p></o:p></span></p><ul style=\"margin-top:0in\" type=\"disc\">\r\n</ul>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-bidi-language:EN-US\">Robert E. McKenzie is a partner of the\r\nlaw firm of Saul Ewing Arnstein &amp; Lehr LLP of Chicago, Illinois,\r\nconcentrating his practice in representation before the Internal Revenue\r\nService and state agencies. He has lectured extensively on the subject of\r\ntaxation. He has presented courses before thousands of CPA’s, attorneys and\r\nenrolled agents nationwide. He has made numerous media appearances including\r\nDateline NBC and The ABC Nightly News. He dedicates a major portion of his time\r\nto representation before the IRS. In 2017 Mr. McKenzie received the American\r\nBar Association Civil and Criminal Tax Penalties Committee’s Jules Ritholz\r\nAward. The award recognizes McKenzie’s dedication and achievement in the field\r\nof tax controversy. From 2009 to 2011, Mr. McKenzie was a member of the IRS\r\nAdvisory Council, which advises IRS management. He has been selected as a\r\nFellow of the American College of Tax Counsel and served as its President from\r\n2017 to 2018. He was vice chair of the ABA Tax Section (2003-2005). Mr.\r\nMcKenzie is past chairman of the Employment Tax Committee, past co-chair of the\r\nTask Force for Bankruptcy Legislation of the ABA Section on Taxation and past\r\nchairman of the Chicago Bar Association Federal Tax Committee. He was Dean of\r\nthe National Tax Practice Institute (1998-2002). Additional information can be\r\nfound on Mr. McKenzie’s website, mckenzielaw.com, where he also keeps an active\r\ntax blog.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-bidi-language:EN-US\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:EN-US\">Mr. McKenzie received his\r\nJ.D. with High Honors from the Illinois Institute of Technology, Chicago Kent\r\nCollege of Law.</span><br></p>', '<p>NA</p>', 0, '2020-09-02 16:14:16', '2020-10-09 17:51:24', NULL),
