(39, '67877bf5-04de-4571-8746-881b959cec5c', 1, '0', 4, 1, '2020-irs-representation-update', '2020 IRS Representation Update', 'Robert E. McKenzie', 'products/speaker//speaker_647706.jpg', 'products//products_944486.jpg', 159.00, '2020-10-22 13:00:00', '120', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">COVID-19 has dramatically changed IRS\r\nenforcement procedures. This class will provide a timely update of current IRS\r\ninitiatives and procedures. IRS has taken steps to rein in its tough\r\nenforcement approach.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Over the past several years, the IRS has seen\r\nits budget cut significantly. There has been a corresponding reduction in the quality\r\nof service that it provides, including a dramatic cutback in its enforcement\r\nefforts. 2019 was a turning point for IRS. It was able to hire 1,000 new\r\nenforcement professionals. The new IRS commissioner is improving morale at the\r\nagency.&nbsp; This course will examine the methods the IRS is using in this new\r\nenforcement climate. It will cover new IRS examination and collection\r\npriorities and procedures, IRS criminal investigation initiatives, recent\r\nimportant developments for practitioners, and taxpayer advocate services. Other\r\ntopics to be discussed include problems in the tax system, new procedures at\r\nIRS campuses, and the impact of new IRS leadership. This course is certain to\r\nget you up to speed on how to properly advise your clients in this new enforcement\r\nenvironment.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Session Highlights:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">IRS COVID-19\r\ninitiatives<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Identify IRS\r\ninitiatives in examinations<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;lin