t-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Recognize IRS budget\r\nproblems and its impact on your clients<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Discuss IRS penalty\r\nprocedures and analyze common IRS penalties<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Who Should Attend?</span></b><br></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Enrolled Agents<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">CPAs<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Tax Attorneys<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Financial planners<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Other finance\r\nprofessionals</span></p><p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:3.0pt;\r\nmargin-left:.25in;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">OTRPs</span></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Robert E. McKenzie is a partner of the law\r\nfirm of Saul Ewing Arnstein &amp; Lehr LLP of Chicago, Illinois, concentrating\r\nhis practice in representation before the Internal Revenue Service and state\r\nagencies. He has lectured extensively on the subject of taxation. He has presented\r\ncourses before thousands of CPA’s, attorneys and enrolled agents nationwide. He\r\nhas made numerous media appearances including Dateline NBC and The ABC Nightly\r\nNews. He dedicates a major portion of his time to representation before the\r\nIRS. In 2017 Mr. McKenzie received the American Bar Association Civil and\r\nCriminal Tax Penalties Committee’s Jules Ritholz Award. The award recognizes\r\nMcKenzie’s dedication and achievement in the field of tax controversy. From\r\n2009 to 2011, Mr. McKenzie was a member of the IRS Advisory Council, which\r\nadvises IRS management. He has been selected as a Fellow of the American\r\nCollege of Tax Counsel and served as its President from 2017 to 2018. He was\r\nvice chair of the ABA Tax Section (2003-2005). Mr. McKenzie is past chairman of\r\nthe Employment Tax Committee, past co-chair of the Task Force for Bankruptcy\r\nLegislation of the ABA Section on Taxation and past chairman of the Chicago Bar\r\nAssociation Federal Tax Committee. He was Dean of the National Tax Practice\r\nInstitute (1998-2002). Additional information can be found on Mr. McKenzie’s\r\nwebsite, mckenzielaw.com, where he also keeps an active tax blog.<o:p></o:p></span></p><p>\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Mr. McKenzie received his\r\nJ.D. with High Honors from the Illinois Institute of Technology, Chicago Kent\r\nCollege of Law.</span><br></p>', '<p>NA</p>', 0, '2020-09-01 11:26:46', '2020-10-09 17:51:43', NULL);
