:#333333;\r\nmso-bidi-language:EN-US\">This seminar covers many of the common issues facing\r\nproperty managers and property owners today. We will go over how to correctly\r\ndocument various tenant violations and strategies and techniques for\r\ndocumenting and solving resident violations. Also discussed are assistance\r\nanimals and the latest rulings on verification. This has been a “hot topic”\r\nrecently and you will receive guidance and what to do.</span><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\"><o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">What will you achieve?<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-famil