amily:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Paul has been involved\r\nin the real estate industry for the past 38 years. He has been involved in\r\nsales, construction, project management, appraisal, mortgage consulting and\r\nbrokerage, property management and property management consulting/training.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Through his consulting\r\ncompany, Property Management Solutions, he provides training and consulting\r\nservices nationwide to owners, management companies, multi-housing\r\nassociations, as well as state and federal agencies.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">He specializes in fair\r\nhousing issues and has developed fair housing and outreach programs for\r\ngovernmental agencies as well as conducting seminars which are presented to\r\nproperty management companies, apartment associations and the general public.\r\nHe also conducts research analysis for impediments to fair housing for grantees\r\nof federal CDBG funds. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">Most recently, he has\r\nbeen a consultant to the City of Sioux Falls and the State of South Dakota. In\r\nthis assignment he has developed a fair housing awareness program that is one\r\nof the first of its kind in the nation. It involves a three pronged approach to\r\nfair housing awareness. This approach makes use of an ombudsman concept and has\r\nproven to be very effective in dealing with discrimination and landlord/tenant\r\nissues.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-bidi-language:EN-US\">For over twenty years\r\nwas involved in appraisal of residential, multi-family, farm and commercial\r\nproperties throughout the Midwest. Most recently, he was a consultant for\r\naffordable, multi-housing properties in 22 different states. This involved\r\nproperties in HUD, Rural Development, HOME and Tax Credit programs.<o:p></o:p></span></p>', '<p>NA</p>', 1, '2020-09-02 15:45:19', '2020-11-01 23:36:14', NULL),
(37, 'cb87a8e4-cae0-40f7-bd84-6d21109c4881', 1, '0', 5, 1, 'multi-state-taxation-and-covid-19-reliefs', 'Multi State Taxation and COVID-19 Reliefs', 'Dayna Reum CPP FPC', 'products/speaker//speaker_210756.jpg', 'products//products_529546.jpg', 159.00, '2020-09-29 14:00:00', '60', '<p class=\"MsoNormal\" style=\"line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Understanding how to calculate tax for employees in 2 or more states can be confusing.&nbsp; Plus what state laws for payroll need to be followed when employing employees in more than one state. To better understand the laws in each state and the tax guidance on how to determine taxation when employees live in one state and work in another.&nbsp; Or for employees that work in multiple states for travel for work.&nbsp; Also, other state laws that affect payroll will be discussed.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">This webinar will be tailored to employers that have a large number of employees that may telecommute across state borders and how employers can manage the tax liability for those employees. Especially when these employees perform work in multiple states.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">We will also discuss the relaxed state requirements due to COVID-19 and the need for employees to work from home.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Session highlights:<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Telecommuting and why it creates a tax liability for employers<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Residency<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&