tyle=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Benefits of attending session:<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Review how to properly determine SUI state<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Understanding multi-state taxation and how to properly review the laws to stay compliant<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Best practices on how other employers handle multi-state concerns<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Understanding state to state changes<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Review of COVID-19 state relaxations<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Who should attend?<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p><p style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Payroll professionals<o:p></o:p></span></p><p style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">HR Professionals<o:p></o:p></span></p><p style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Accounting Professionals<o:p></o:p></span></p><p style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Tax Professionals</span></p><p style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"text-indent: -0.25in; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Benefits Professionals</span></p>', '<p><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 15.3333px; text-align: justify;\">Dayna is currently the Director of Payroll Operations at Ann &amp; Robert Lurie Children’s Hospital of Chicago. Dayna has been heavily involved in the payroll field over 17 years. Starting as a payroll clerk at a small Tucson company, Dayna moved on to be a Payroll Team Leader at Honeywell Inc. During Dayna’s time at Honeywell she obtained her FPC (Fundamental Payroll Certification) through the American Payroll Association. She also received several merit awards for Customer Service and Acquisitions and Divestitures. Dayna is no stranger to teaching she has taught at the Metro Phoenix American Payroll Association meetings and at the Arizona State Payroll Conference. Topics including Payroll Basics, Global/Cultural Awareness, Immigration Basics for the Payroll Professional, Multi-State and Local Taxation and Quality Control for Payroll, International and Canadian payroll. Dayna has her CPP (Certified Payroll Professional) through the APA. She also serves on the National American Payroll Association on the National Strategic Leadership Task Force, Government Affairs Task Force (PA Local tax subcommittee). Dayna has received a Citation of Merit for her service along with being a Gold Pin member of the APA. Besides her payroll accomplishments Dayna is certified in HR hiring and firing practices and is a Six-Sigma Greenbelt.</span><br></p>', '<p>NA</p>', 0, '2020-08-30 20:40:18', '2020-10-01 18:50:20', NULL);
