(38, '7446b395-3567-4093-a1c5-8d72e8577e92', 1, '0', 1, 3, 'icd-10-cm-changes-for-2021', 'ICD-10-CM Changes for 2021', 'Lynn M. Anderanin-CPC', 'products/speaker//speaker_566953.jpg', 'products//products_382570.jpg', 159.00, '2020-10-08 13:00:00', '90', '<p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Each year the International Classification of Diseases (ICD) Version 10 Clinical Modifications (CM) is updated for the upcoming year. The ICD-10-CM becomes effective on October 1st of every year with no grace period. This presentation will review all of the changes for professional services beginning with the October 1, 2020 date of service for proper coding to avoid delays in reimbursement.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Session highlights:</span><o:p></o:p></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt 0.25in; text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">ICD-10-CM Official Guideline changes and how to apply them.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">All new codes added to the 2021 edition.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">63 codes that will no longer be valid and what to use instead<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">50 code description changes that could change code assignment<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Understand the latest updates for coding COVID-19 situations<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Chapter by chapter changes for the entire ICD-10-CM manual<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Coding for vaping and e-cigarette disorders<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Benefits of attending session:<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn all of the updates for ICD-10-CM. This will include code additions by chapter, as well as code revisions and invalid codes. In addition to the codes changes, you will also learn the official guideline changes that assist in assigning the appropriate codes as well as code combinations and sequencing.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What will you achieve?<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will be able to review your current code list and update it according to the changes.&nbsp; You also will be able to educate others in your office as to why changes were made and the documentation that will be necessary to support the current codes. This ultimately results in the submission of clean claims and return payment efficiently.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: 600;\"><u><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Who should attend?<o:p></o:p></span></u></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helveti