1);\">Physician Assistants<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 3pt 0.25in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt 0.25in; text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Administrators</span></p>', '<p style=\"text-align: justify; \"><span style=\"font-size:11.5pt;line-height:115%;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:\r\nEN-US\">Lynn Anderanin, CPC, CPPM, CPMA, CPC-I, COSC, is the Sr. Coding Educator\r\nfor Healthcare Information Services, a physician’s revenue cycle management\r\ncompany in Chicago. She has over 35 years’ experience in all areas of the\r\nphysician practice, specializing in Orthopaedics.&nbsp; Lynn is currently a Workshop and Audio\r\nPresenter. She is a former member of the American Academy of Professional\r\nCoders (AAPC) National Advisory Board, as well as several other boards for the\r\nAAPC. She is also the founder of her Local Chapter of the AAPC.</span><br></p>', '<p>1 AAPC Approved CEU</p>', 1, '2020-08-30 20:51:09', '2020-11-13 13:40:10', NULL),
(43, '47f00b72-3683-47bc-958f-317ed454c0e0', 1, '0', 3, 3, 'excel---the-business-intelligence-toolkit---creating-a-dashboard', 'Excel - The Business Intelligence Toolkit - Creating a Dashboard', 'Mike Thomas', 'products/speaker//speaker_639708.jpg', 'products//products_585873.jpg', 99.00, '2020-10-14 13:00:00', '60', '<p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><b><u><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">Overview:</span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><b><u><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\"><br></span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">No\r\nmatter what business you are in, a dashboard is a critical tool in your\r\ncommunication armoury and as with any communication tool, presentation is\r\neverything. Although there are many tools that can be used to create a\r\ndashboard, Excel is commonly used due to its power, it’s flexibility and the\r\nfact that most people have it installed on their computer. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">This\r\ntraining focuses on what you need to know to create an interactive\r\nprofessional-looking dashboard using Excel. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">What will you learn?<o:p></o:p></span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">You\'ll\r\nlearn how to make the dashboard maintenance-free when new data becomes\r\navailable; create the pivot tables needed to drive the dashboard; create great\r\nlooking visuals and add interactivity using slicers.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Benefits of attending\r\nsession:<o:p></o:p></span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">In\r\nthis training session, you\'ll learn how to create a stunning, interactive\r\nprofessional-looking dashboard using Excel. This training will provide you with\r\na solid foundation that you can use to build your own dashboards and reports.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Session highlights:<o:p></o:p></span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><ul style=\"margin-top:0in\" type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:3.0pt;text-align:justify;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-ansi-language:EN-GB\">Best practice for setting up\r\n     data sources<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:3.0pt;text-align:justify;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-ansi-language:EN-GB\">Using Pivot Tables to summarize\r\n     data<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:3.0pt;text-align:justify;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-ansi-language:EN-GB\">Visual communication using\r\n     charts<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:3.0pt;text-align:justify;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-ansi-language:EN-GB\">Using formulas to create KPI\r\n     summaries<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:3.0pt;text-align:justify;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-ansi-language:EN-GB\">Creating interactive filters\r\n     with Slicers<o:p></o:p></span></li>\r\n</ul><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Who should attend?<o:p></o:p></span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">This\r\nwebinar is for any user of Excel who wants to learn how to create Excel\r\ndashboards. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">You\r\nshould have an intermediate level of Excel knowledge and preferably know how to\r\ncreate a basic pivot table.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">The training will be\r\ndelivered using the latest version of Excel for Windows although much of the\r\nfunctionality is available in earlier versions of the application.</span><br></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Mike Thomas has worked in the IT\r\ntraining business since 1989. He is a subject matter expert in a range of\r\ntechnologies including Microsoft Office and Apple Mac.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">In 2012 Mike founded\r\ntheexceltrainer.co.uk where he has produced nearly 200 written and video-based\r\nExcel tutorials.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">He has recorded several Excel training\r\ncourses for pluralsight.com and in his career delivered hundreds of courses and\r\nwebinars on a wide variety of technology-related topics.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Mike is a Fellow of The Learning and\r\nPerformance Institute and has worked with and for a large number of global and\r\nUK-based companies and organizations across a diverse range of sectors.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">In addition to training, he also designs\r\nand develops Microsoft Office-based solutions that automate key business tasks\r\nand processes.</span><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212529\"><o:p></o:p></span></p>', '<p>NA</p>', 1, '2020-09-07 20:39:47', '2020-11-01 23:51:38', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(44, '475c54c5-04e7-4014-8a6d-076ced531e87', 1, '0', 3, 1, 'excel---the-business-intelligence-toolkit---effective-data-visualization', 'Excel - The Business Intelligence Toolkit - Effective Data Visualization', 'Mike Thomas', 'products/speaker//speaker_891036.jpg', 'products//products_225793.jpg', 99.00, '2020-12-02 13:00:00', '60', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u>Overview:</u></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u><br></u></b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">\"Every Picture Tells a Story\" is a popular saying\r\nwhich is true not only in everyday life but in Excel too. Behind your set of\r\nnumerical data is a story waiting to be told. The telling of this story needs\r\nto be to-the-point, easy to understand and engaging.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">Data visualization is the representation of numerical data in a\r\nvisual format so that your audience can quickly and easily understand it and\r\ngain insight from it. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">This training covers how to visually represent your data using\r\nboth traditional charts (bar charts, line charts etc.) as well as how to do the\r\nsame using some of Excel\'s non-charting tools.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 15.3333px;\"><b><u>What will you learn?</u></b></span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font color=\"#333333\" face=\"Helvetica, sans-serif\"><span style=\"font-size: 15.3333px;\"><b><u><br></u></b></span></font></p><ul style=\"margin-top:0in\" type=\"disc\"><li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Learn how to select the most\r\n     appropriate chart to convey your message<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Learn how to create a chart\r\n     from a set of data and change its appearance<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Learn how to create Sparkline\r\n     charts (really useful in dashboards) <o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Learn how to create\r\n     infographic-style charts <o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Learn how to represent data in\r\n     a visual way without using the charting tools<o:p></o:p></span></li>\r\n</ul><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><b><u>Why you should attend?</u></b></span><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\"><br></span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">Until a few years ago it was enough to take a set of numbers and\r\ncreate a bar chart or pie chart. Although in the right situation these\r\ntraditional charts are still appropriate, things have moved on and we\'re constantly\r\nhearing words like Data Visualization and Infographic. It\'s time to get your\r\nExcel-related business and communication skills up to date and learn how to use\r\nit to present data in the modern world.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u>Session Highlights:</u></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u><br></u></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><o:p></o:p></span></p><ul style=\"margin-top:0in\" type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Charting 101 - create a basic\r\n     chart<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">From drab to fab - enhance and\r\n     customize a basic chart<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Combination charts - line and\r\n     bar in a single chart<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Dynamic charts - automate\r\n     adding new data to a chart<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Creating in-cell Sparkline\r\n     charts<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Creating infographics with\r\n     Excel<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Creating a heat map using Conditional\r\n     Formatting<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color: rgb(51, 51, 51); margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;\">Data Visualization using\r\n     symbols and icons<o:p></o:p></span></li>\r\n</ul><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u>Who should attend?</u></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\"><b><u><br></u></b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">This training is categorized as basic-to-intermediate. It is\r\naimed at users who have little or no knowledge of how to produce charts and\r\nrepresent data visually in Excel. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;