(45, '2a0c53ac-17a8-4be1-92ab-43a05884a3a8', 1, '0', 3, 1, 'excel---the-business-intelligence-toolkit---pivot-tables-beyond-the-basics', 'Excel - The Business Intelligence Toolkit - Pivot Tables Beyond The Basics', 'Mike Thomas', 'products/speaker//speaker_746055.jpg', 'products//products_240568.jpg', 99.00, '2020-11-19 13:00:00', '60', '<h1><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333;mso-ansi-language:EN-US\"><b><u>Overview:</u></b><o:p></o:p></span></h1><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Pivot\r\nTables are one of the most powerful tools in Excel’s data analysis and Business\r\nIntelligence (BI) armory.</span><br></p><p class=\"MsoNormal\"><span style=\"font-size:11.5pt;line-height:115%;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">With\r\njust a few clicks of the mouse (and no complicated formulas!) you can quickly\r\nand easily build the reports, dashboards and charts that help you to summarize,&nbsp; analyze, interpret and understand your data\r\nwhich in turn helps you to spot trends and get answers to the important\r\nquestions on which you base your key business decisions.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.5pt;line-height:115%;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">This\r\ntraining enables anyone who is familiar with the basics of pivot tables to take\r\ntheir skills and knowledge to the next level.<o:p></o:p></span></p><p class=\"MsoNormal\"><b style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\"><u>What will you learn?</u></b></p><ul><li><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Use\r\nPivot Tables to turn raw data into meaningful and insightful reports</span><br></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Use\r\nPivot Tables to create different types of summary reports <o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Use\r\nformulas in a Pivot Table<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Use\r\nSlicers to create interactive Pivot Table reports<o:p></o:p></span></li></ul><p class=\"MsoNormal\"><b style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\"><u>Why you should attend?</u></b><br></p><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">From\r\nglobal enterprises to early-stage startups and small businesses, people\r\neverywhere use Pivot Tables to see and understand their data.</span><br></p><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Learning\r\nhow to create Pivot Tables is one of the must have skills for anyone who needs\r\nto use Excel to quickly build reports and summaries.</span><br></p><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">This\r\ntraining will enable anyone who is familiar with the basics of pivot tables to\r\ntake their skills and knowledge to the next level.</span><br></p><p class=\"MsoNormal\"><b style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\"><u>Session Highlights:</u></b></p><ul><li><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Producing\r\na Difference report (month-on-month or year-on-year)</span></li><li><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Producing\r\nRunning Totals and Top 10 reports</span></li><li><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333;mso-ansi-language:EN-US\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Use\r\nPivot Tables to produce a \"unique count\" report<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Use\r\nPivot Tables to produce time-based reports (quarterly, monthly etc)<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Create\r\nadditional columns in a Pivot Tables using formulas<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Combine\r\nrow items in a Pivot Tables using formulas<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">GETPIVOTDATA\r\n– What is it? When to use it and when to avoid it<o:p></o:p></span></li><li><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US\">Using\r\nSlicers to Slice, Dice and Filter your data</span><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">&nbsp;</span></li></ul><h1><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333;mso-ansi-language:EN-US\"><b><u>Who should attend?</u></b><o:p></o:p></span></h1><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">If\r\nyou are familiar with the basics of pivot tables (creating a basic pivot table,\r\nchanging the appearance and layout, sorting, creating a pivot chart) and you\r\nwish to take your knowledge to the next level, this training is for you.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">The training will be\r\ndelivered using&nbsp;the latest version of Excel&nbsp;for Windows although much\r\nof the functionality is available in earlier versions of the application</span><br></p>'