reast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Mike is a Fellow of The Learning and\r\nPerformance Institute and has worked with and for a large number of global and\r\nUK-based companies and organizations across a diverse range of sectors.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-GB\" style=\"font-size:\r\n11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#333333;mso-ansi-language:EN-GB\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-GB;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">In addition to training, he\r\nalso designs and develops Microsoft Office-based solutions that automate key\r\nbusiness tasks and processes.</span><br></p>', '<p>NA</p>', 0, '2020-09-09 18:20:25', '2020-11-20 01:03:56', NULL);
