(46, '0262c552-1f64-48f8-bfbb-0439e6fa5d15', 1, '0', 2, 3, 'stop-avoiding-difficult-conversations-practical-tactics-for-crucial-communication', 'Stop Avoiding Difficult Conversations: Practical Tactics for Crucial Communication', 'Joel Garfinkle', 'products/speaker//speaker_141378.png', 'products//products_550638.jpg', 159.00, '2020-10-28 13:00:00', '60', '<p class=\"MsoNormal\"><b><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\"><br></span></b></p><p class=\"MsoNormal\"><b><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Learn How to Handle Difficult\r\nConversations and Minimize Conflict and Tension<br>\r\n&nbsp;<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Every workplace experiences conflict,\r\nconfrontation, and controversy. No one enjoys tackling the touchy topics; but,\r\nan attitude of avoidance leads to misunderstanding and decreased productivity.\r\nYour employees will always have differences of opinion; however, if these\r\ndifferences are not handled in a positive manner, your people will experience\r\nanxiety, bruised egos, and possibly even exploding tempers.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-fa