-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn about conflict: All difficult conversations have some “conflict”\r\nat its root.</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:.25in;mso-add-space:auto;\r\ntext-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How conflict arises between co-workers, supervisors and subordinate.</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:.25in;mso-add-space:auto;\r\ntext-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How to manage different types of conflict: Disagreement in meetings, communication obsta