nt-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How being liked can stop you from having the conversation.</span><br></p><p class=\"MsoListParagraphCxSpMiddle\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Wingdings; color: rgb(51, 51, 51);\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Get a road map to follow when preparing for and engaging in difficult\r\nconversations.</span><br></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">6 questions that will prepare you for all difficult conversations.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How does the other person perceive the situation and what assumptions\r\nare you making.</span><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><!--[if !supportLists]--><span lang=\"EN-GB\" style=\"font-size:12.0pt;line-height:115%;font-family:Wingdings;\r\nmso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings;color:#333333;\r\nmso-ansi-language:EN-GB\">Ø<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333;mso-ansi-language:\r\nEN-GB\">Learn a 4-step process that will lead to a successful outcome of the\r\ndifficult conversation.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Step 1 Listening – begin the conversation by listening.</span><br></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Step 2 Mirroring – simply reflecting back the other person’s point of\r\nview.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Step 3 Questioning – asking open-ended questions.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.25in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l3 level1 lfo1;tab-stops:list .25in\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 12pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Step 4 Empathy – actually understanding what the other person is\r\nfeeling.</span><br></p><p class=\"MsoNormal\"><b><u><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Webinar&nbsp;Highlights:</span></u></b><br></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:Helvetica;color:#333333;mso-ansi-language:EN-GB\">This\r\nsession will help you:</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Improve your conflict-resolution skills.</span><br></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Prepare for and engage in difficult conversations.</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Discuss what matters most with co-workers and employees in a\r\nnon-confrontational manner.</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Understand how to make other people feel heard and understood so you can work together to come up with solutions.</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Use conflict as an opportunity to create a positive outcome.</span><br></p><p class=\"MsoListParagraphCxSpLast\"><b><u><span lang=\"EN-GB\" style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Who should&nbsp;Attend:</span></u></b><br></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">CEO, CFO, COO, CTO</span><br></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Senior Vice Presidents</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Vice Presidents</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Regional Managers</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers and Supervisors</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Newly Promoted Managers</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">High Potential Employees&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Executive directors</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managing directors</span></p><p class=\"MsoNormal\"><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">&nbsp; &nbsp; ·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-GB\" style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">HR managers</span></p><p class=\"MsoNormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Team Leaders</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-GB\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-GB\">Joel Garfinkle has 20 years’ speaking\r\nexperience as both a keynote speaker and a corporate trainer\r\n(joelinspirationalspeaker.com/) Joel’s clients include Oracle, Ritz-Carlton\r\nHotels, Toyota, NBA, Warner Bros and Nestlé. He has written 7 books and more\r\nthan 300+ articles on leadership, workplace issues and career advancement <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:3.0pt;text-align:justify;line-height:\r\nnormal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Joel is acknowledged as one of the\r\ntop-50 executive coaches in U.S. Global Gurus listed him 14th on the list of\r\ntop-30 global coaching experts. He is a Master Certified Coach (highest\r\naccreditation in the profession of coaching from the International Coach\r\nFederation). Joel’s speeches and trainings draw on his first-hand experience of\r\nworking closely with more than 1,800 coaching clients and top executives of\r\nthese world’s leading companies: Google, Microsoft, Starbucks, Netflix,\r\nDeloitte, IBM, NBC Universal and Amazon.</span><br></p>', '<p>NA</p>', 1, '2020-09-11 18:20:54', '2020-12-09 00:22:32', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(47, 'a289f83d-c31a-400e-b5e4-2f17434f9c8c', 1, '0', 2, 3, 'prioritize-your-work-for-maximum-impact', 'Prioritize Your Work for Maximum Impact', 'Joel Garfinkle', 'products/speaker//speaker_521797.png', 'products//products_881716.jpg', 159.00, '2020-12-08 13:00:00', '60', '<span style=\"box-sizing: border-box; outline: none !important; padding: 0px; margin: 0px; color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\"><p align=\"center\" style=\"margin: 0in 0in 0pt; text-align: center; line-height: normal;\"><b style=\"mso-bidi-font-weight:normal\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";mso-fareast-font-family:&#10;\"Times New Roman\";mso-bidi-font-family:Helvetica;color:#333333\'><br></span></b></p><p align=\"center\" style=\"margin: 0in 0in 0pt; text-align: center; line-height: normal;\"><b style=\"mso-bidi-font-weight:normal\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";mso-fareast-font-family:&#10;\"Times New Roman\";mso-bidi-font-family:Helvetica;color:#333333\'>Power of\r\nprioritization: </span></b><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Protecting Your Time and Getting More Done</span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\">\r\n\r\n<b style=\"mso-bidi-font-weight:normal\"><span style=\'font-size:11.5pt;&#10;font-family:\"Helvetica\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";&#10;mso-bidi-font-family:Helvetica;color:#333333\'>Learn How to Prioritize Your Work\r\nfor Maximum Impact</span></b><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'><span style=\"mso-spacerun:yes\">&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\">\r\n\r\n<span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Every one of us has 24 hours a day to use as we choose. The\r\nquestion is whether or not we use that time effectively. Successful leaders\r\nprioritize and complete what’s most important. They are laser-focused on\r\nexecuting work that has the most impact. They know how to take back time by\r\nutilizing time blocking, delegation, and saying no to anything that gets in the\r\nway of high priority tasks. </span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\">\r\n\r\n<span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>This webinar will help you use prioritization skills to manage\r\nyour time instead of letting time manage your lives. The number one source for\r\nproductivity is prioritization and it’s a process that successful leaders use\r\nto assure that they are focused on the right things. </span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; pad