normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Prioritize your work according to what is most important.</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Block out your calendar for the most important tasks.</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Improve productivity through delegation.</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Eliminate, delegate, and have fewer meetings.</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Stop short-term urgent daily tasks from getting in the way of\r\nyour top priorities.</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Learn the value of “no.”</span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\">\r\n\r\n<b style=\"mso-bidi-font-weight:normal\"><u><span style=\'font-size:11.5pt;&#10;font-family:\"Helvetica\",\"sans-serif\";mso-fareast-font-family:\"Times New Roman\";&#10;mso-bidi-font-family:Helvetica;color:#333333\'>Who should Attend:</span></u></b></p><p style=\"margin: 0in 0in 0pt; line-height: normal;\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>&nbsp;</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>CEO, CFO, COO, CTO</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Senior Vice Presidents</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Vice Presidents</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Regional Managers</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Managers and Supervisors</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Newly Promoted Managers</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>High Potential Employees </span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Executive directors</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Managing directors</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>HR managers</span></p><p style=\"margin: 0in 0in 0pt 0.5in; line-height: normal; text-indent: -0.25in;\"><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#333333\"><span style=\"mso-list:Ignore\">·<span style=\'font:7.0pt \"Times New Roman\"\'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Team Leaders</span></p><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\">\r\n<span style=\'font-size:11.5pt;line-height:115%;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:&#10;AR-SA\'>At the Q&amp;A session following each live event, ask a question and get\r\na direct response from our expert speaker.</span></p></span><p class=\"MsoNormal\" style=\"margin: 15px 0px 0px; padding: 0px; outline: invert !important; color: rgb(0, 0, 0); text-transform: none; line-height: 1.6; text-indent: 0px; letter-spacing: normal; font-family: Montserrat,sans-serif; font-size: 16px; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2;\"><br></p><p><b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p>', '<p>\r\n\r\n</p><p style=\"margin: 0in 0in 0pt; text-align: justify; line-height: normal;\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Joel Garfinkle has 20 years’ speaking experience as both a\r\nkeynote speaker and a corporate trainer (joelinspirationalspeaker.com/) Joel’s\r\nclients include Oracle, Ritz-Carlton Hotels, Toyota, NBA, Warner Bros and\r\nNestlé. He has written 7 books and more than 300+ articles on leadership,\r\nworkplace issues and career advancement</span></p><p>\r\n\r\n</p><p style=\"margin: 0in 0in 0pt; text-align: justify; line-height: normal;\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>&nbsp;</span></p><p>\r\n\r\n</p><p style=\"margin: 0in 0in 0pt; text-align: justify; line-height: normal;\"><span style=\'font-size:11.5pt;font-family:\"Helvetica\",\"sans-serif\";&#10;mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:Helvetica;&#10;color:#333333\'>Joel is acknowledged as one of the top-50 executive coaches in\r\nU.S. Global Gurus listed him 14th on the list of top-30 global coaching\r\nexperts. He is a Master Certified Coach (highest accreditation in the\r\nprofession of coaching from the International Coach Federation). Joel’s\r\nspeeches and trainings draw on his first-hand experience of working closely\r\nwith more than 1,800 coaching clients and top executives of these world’s\r\nleading companies: Google, Microsoft, Starbucks, Netflix, Deloitte, IBM, NBC\r\nUniversal and Amazon.</span></p><p>\r\n\r\n<b></b><i></i><u></u><sub></sub><sup></sup><strike></strike><br></p>', '<p>NA<br></p>', 1, '2020-10-09 10:09:19', '2020-12-09 00:16:38', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(48, 'c62d76df-ee21-4dac-83be-f844313c4932', 1, '0', 5, 1, 'mental-illness-adaaa-and-the-workplace-taking-responsibility-as-an-employer', 'Mental Illness, COVID, ADAAA, and the Workplace: Taking Responsibility as an Employer', 'Dr. Susan Strauss', 'products/speaker//speaker_529727.jpeg', 'products//products_379092.jpg', 199.00, '2020-12-11 13:00:00', '90', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Mental Illness, ADAAA,\r\nand the Workplace: Taking Responsibility as an Employer<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">More and more people are complaining of\r\nfeeling depressed, anxious, hopeless, and just plain out of sorts. These\r\ncomplaints have escalated during the pandemic. COVID is taking a toll on\r\nemployees. Add working virtually and it is compounded. Therapists indicate that\r\nmore and more people are seeking therapy, especially since the 2016 election\r\nand now the pandemic. Millennials, the largest workgroup in our workplaces,\r\nhave an increase in depression. These are your employees—What are your\r\nresponsibilities as a manager or HR professional in recognizing and helping\r\nthem?&nbsp; How can you ensure your\r\norganization’s climate is a safe and healthy place rather than a climate that\r\nmight exacerbate poor mental health?<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Employers are seeing more mental health issues\r\nin their workforce than ever before.&nbsp;\r\nEach year 1 in 5 adults is stricken with a mental illness (National\r\nInstitute of Mental health), making mental illness an everyday reality for many\r\nof your employees.&nbsp; Yet, only 1 in 3\r\npeople seek help with their illness. The ADA, HIPPA, FMLA, and most states’\r\nhuman/civil rights departments dictate how employers deal with employees with\r\nmental health problems. Privacy laws create challenges for employers to\r\ndetermine how serious a situation is and whether an employee poses a danger\r\n(though those with mental illness pose no more risk of violence than those\r\nwithout a mental illness).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Examples of the most common psychological\r\ndisorders include major depression and dysthymia, bipolar disorder, anxiety,\r\nschizophrenia, and an array of personality disorders. Those individuals with\r\ndepression have 2.5 times the risk of on the job injury. Workplace depression\r\nresults in 200 million lost days annually. The disease is common, debilitating,\r\nand the number one cause of disability worldwide. Employers lose an estimated\r\n$52 billion annually in loss of productivity and insurance payments.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">In 2016, the EEOC resolved 5000\r\ndisability-based claims dealing with mental health conditions costing employers\r\napproximately $20 million. With the increase in claims came an EEOC newly\r\nreleased Guidance on Mental Health Discrimination which is addressed to\r\nemployees informing them of their employment rights under the ADA.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Workplaces can and should play a significant\r\nrole in minimizing their employees’ mental health risks. Employee stress levels\r\ncontinue to rise as more and more employees spend more and more hours at work\r\nwithout an increase in pay or benefits. Burnout and depression, particularly to\r\nmillennials and millennial women are reported more than any other generation.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Webinar Objectives<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Mental illness is a largely misunderstood\r\ndisease that carries much stigma in society and in the workplace. 70% of people\r\nwith depression are employed, many do not seek treatment and when they\r\ndo—medication is able to help only about 66% of those who are depressed.\r\nApproximately 20% of the population has any one of a number of personality\r\ndisorders—those who do are often difficult to manage. Anxiety is one of the\r\nmost common mental illnesses with some research suggesting it is the most\r\ncommon U.S. mental health problem; other research indicates depression is the\r\nnumber one disability. Mental illness is a covered disability under the ADAAA\r\nand therefore is subject to the law of the ADAAA including the requirement to\r\nengage in an interactive process. Managers and HR professionals often walk a\r\ndelicate line in dealing with employees who may have a mental illness or\r\nexhibit signs and symptoms that give pause in considering if an employee needs\r\nto be referred for outside assistance such as EAP. But how does one refer a\r\ntroubled employee without violating the ADA? What steps should an organization\r\ntake to create a stigma-free workplace that is centered on the well-being of\r\nits employees’ physical and mental health? These issues will be discussed in\r\nthis webinar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Webinar Agenda</span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To differentiate mental health from mental illness</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·</span><span style=\"text-indent: -0.25in; line-height: 115%; color: rgb(51, 51, 51);\"><font face=\"Times New Roman\" size=\"1\">&nbsp; &nbsp; &nbsp; </font></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To discuss the most frequent mental health conditions with\r\nemphasis on depression, anxiety, and personality disorders</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To identify the demographic groups most at risk for mental\r\nhealth issues</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To examine the myths of mental illness</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To list signs of possible mental health issues</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To outline U.S. mental illness statistics</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To explain mental illness as an ADA protected disability</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To describe the interactive process required by the ADA</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To explore ADA required accommodations</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To examine the role of the workplace to create a healthy\r\nenvironment</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To combat the negative stigma of mental illness in the workplace</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">To generate a workplace culture of well-being</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Who should Attend</span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">HR</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Risk Management</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Any employee</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">All industries</span></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Dr. Susan Strauss is a national and\r\ninternational speaker, trainer and consultant. She has worked as a psychiatric\r\nnurse and her undergraduate degree is in psychology and human services. Her\r\nspecialty areas include discrimination, harassment, and bullying;\r\nmanagement/leadership development, and organization development. She conducts\r\nharassment and bullying investigations and works as an expert witness for\r\ndiscrimination lawsuits. Susan also trains and consults with business,\r\neducation, healthcare, law, and government organizations from both the public\r\nand private sector.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Dr. Strauss has authored over 30 book\r\nchapters, books, and articles in professional journals. She has been featured\r\non 20/20, CBS Evening News, and other television and radio programs as well as\r\ninterviewed for newspaper and journal articles such as The Times of London,\r\nLawyers Weekly, and Harvard Education Newsletter.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Susan has presented at\r\ninternational conferences in Botswana, Egypt, Thailand, Israel, Bali, Beirut,\r\nand the U.S. She has consulted with professionals from other countries such as\r\nEngland, Australia, Canada, Beirut and St. Maartin, Israel, Bali, and the\r\nMiddle East. She has her doctorate in organizational leadership, is a\r\nregistered nurse with a bachelor’s degree in psychology and human services, a\r\nmaster’s degree in community health, and a professional certificate in training\r\nand development.</span><br></p>', '<p>NA</p>', 0, '2020-10-09 17:46:48', '2020-11-12 17:56:59', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(49, '355849dd-18b5-418f-963c-0667a4c7223a', 1, '0', 5, 3, 'employee-handbook-2020-2021-update', 'Employee Handbook 2020-2021 Update', 'Margie Faulk - PHR, SHRM-CP', 'products/speaker//speaker_774425.jpg', 'products//products_700801.jpg', 159.00, '2020-11-05 13:00:00', '90', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Overview:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\"><o:p><br></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Employee handbooks\r\nhave been a tool for Employers from small to large companies for several years.\r\nMany companies elect to have employee handbooks and utilize employee handbook\r\ntemplates that are provided on-line which we call “cookie cutter handbook”\r\nsince they are created as a “one size fits all”.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Unfortunately,\r\nemployee handbooks can be a huge risk if not updated regularly, adapted to each\r\ncompany, reflect policies that are followed consistently and reflect current\r\nregulations. Employee handbooks are also a critical communication tool for\r\nemployees to understand what the company expects from them as well as what the\r\ncompany expects from employees. Many regulatory agencies like Department of\r\nLabor (DOL), Equal Employment Opportunity Commission (EEOC) Department of\r\nHomeland Security (DHS) and other regulatory agencies have been committed to\r\naudit Employers to ensure compliance with regulations.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">In my workplace\r\ncompliance experience, employees review the handbook when they are new\r\nemployees coming onboard to company and when they are considering leaving the\r\ncompany or when they are considering suing the company.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Over 26-35 regulations\r\nhave changed since 2020. Multi-State regulations have increased and continue to\r\nexpand to other states every year. If you haven’t updated your employee\r\nhandbook since 2019, your handbook is already outdated and is a risk for fines,\r\npenalties and criminal sanctions.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Why Should You Attend:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Did you know that\r\nEmployee Handbooks can be a risk or a benefit for Employers? For years an\r\nEmployee Handbook has been one of the first documents employment law attorneys\r\nrequest when they are planning to pursue workplace charges against an Employer.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Shouldn’t you ensure\r\nthat your employee handbook protects your company instead of exposing it to\r\nnumerous risk? Let me help you create an employee handbook that will reduce\r\nyour company’s risk and help you mitigate the numerous workplace regulations\r\nthat can impact your company.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">What Will You Learn:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Participants will\r\nlearn, identify and prepare for employee handbook violations.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Participants will be\r\naware of all the new regulations that will impact their company.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">The course will\r\nidentify the most common employee handbook violations and how to mitigate them.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn what five\r\nemployee handbook policies do more to reduce risk when added to your handbook.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">New Employee Handbook\r\nchanges established in June 2018 that help Employers!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Participants will\r\nlearn which regulatory agency will focus on which regulation and mitigate the\r\nrisk.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Participants will\r\nlearn what policies will land them in hot water.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What policies are\r\n“must have” for your employee handbook?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">New paid leave laws\r\nand how Employers can manage them.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Impact of “Ban the\r\nBox” regulations on criminal background screening regulations.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">States where asking\r\ncandidates for salary history has been prohibited. This means removing the\r\nsalary history in handbooks, applications, and career websites.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Best practices in\r\ndeveloping an employee handbook.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What is the difference\r\nbetween employee handbooks and company stand alone policies?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Benefits For Attending:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">This training will\r\nprovide you with the necessary guidance to review and create an employee\r\nhandbook that can assist in creating a risk management strategy that reduces\r\nrisk in violating regulations. Also will get:</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">SHRM Recertification PDU Credits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free customized compliance tools in the form of guides,\r\ntemplates, policies, and toolkits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Additional HR Compliance Supplemental Slides</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free answer to all questions even after the training ends</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">What Will You Achieve?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Gain an understanding\r\nof the regulatory process expectation.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">A learning of how to\r\ndevelop an employee handbook that meets the criteria of the changing.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What are the must have\r\npolicies that need to be included in an employee handbook or stand alone\r\npolicies.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Have access to\r\nresources to ensure updates on changing regulations</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Who Should Attend:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Business Owners</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employers</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">HR professionals</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers,\r\nSupervisors/Leads</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Office Managers</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Multi-state Employers</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Facilities Managers</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Workplace Compliance\r\nprofessionals</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Leadership</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Any person wanting to\r\nensure compliance for workplace regulations</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Any professional who wants to learn how to maintain an employee\r\nhandbook as a risk management strategy</span><span style=\"text-indent: -0.25in; font-family: Symbol;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span><o:p style=\"text-indent: -0.25in;\">&nbsp;</o:p></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Margie Faulk is a senior level human resources\r\nprofessional with over 15 years of HR management and compliance experience. A\r\ncurrent Compliance Advisor for HR Compliance Solutions, LLC, Margie, has worked\r\nas an HR Compliance advisor for major corporations and small businesses in the\r\nsmall, large, private, public, Non-profit sectors and International\r\ncompliance.&nbsp; Margie has provided small to\r\nlarge businesses with risk management strategies that protect companies and\r\nreduces potential workplace fines and penalties from violation of employment\r\nregulations. Margie is bilingual (Spanish) fluent and Bi-cultural.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Margie’s area of expertise includes Criminal\r\nBackground Screening Policies and auditing, I-9 document correction and storage\r\ncompliance, Immigration compliance, employee handbook development, policy\r\ndevelopment, sexual harassment investigations/certified training, SOX\r\nregulations, payroll compliance, compliance consulting, monitoring US-based\r\nfederal, state and local regulations, employee relations issues, internal\r\ninvestigations, HR management, compliance consulting, internal/external audits,\r\nand performance management.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">Margie holds professional\r\nhuman resources certification (PHR) from the HR Certification Institution\r\n(HRCI) and SHRM-CP certification from the Society for Human Resources\r\nManagement. Margie is a member of the Society of Corporate Compliance &amp;\r\nEthics (SCCE).</span><br></p>', '<p>1.5 SHRM-CP Credits</p>', 1, '2020-10-13 22:25:03', '2020-12-09 00:21:52', NULL),
(50, '47916a47-b744-4b58-a428-2aa9aaebf00e', 1, '0', 7, 3, 'hud-reac-101-an-overview-and-thorough-explanation-of-the-latest-updates', 'HUD-REAC 101: An overview and thorough explanation of the latest updates', 'Paul Flogstad', 'products/speaker//speaker_371696.jpeg', 'products//products_970865.jpg', 159.00, '2020-11-12 13:00:00', '90', '<p class=\"MsoNormal\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">Summary:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">This seminar will go\r\ninto detail on the UPCS property standard guidelines as well as the Real Estate\r\nAssessment Canter (REAC) inspection process. It will contain information on the\r\nlatest rules and how they are interpreted during an inspection of the property.\r\nThe UPCS guidelines are required for LIHTC properties so this course will go\r\ninto detail so that you may remain in compliance.&nbsp; There will be a number of actual photos of\r\nnon- compliance items to give you a better understanding of the need for these\r\nminimum standards. Learn how to schedule, how to accompany the inspector while\r\nat your property and how to stop a REAC inspection in progress if need be.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">What\r\nWill You Learn?</span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">What are the latest updates to UPCS rules</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">How are these rules interpreted</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">How often will we be inspected?</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">What do the scores mean?</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">What are my rights during an inspection?</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">What are Exigent Health and Safety Items\r\nand how are they mitigated?</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">How do I get a copy of the report?</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">These are the prime areas to be covered\r\nin this session. There will be time for questions and answers</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">Benefits\r\nfor attending:</span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">This will be a real world course. It is\r\njust not textbook answers but solutions and examples of what is “real world”.\r\nInstructor has much experience and will share through actual experiences to\r\nenhance learning.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">You will come away with an understanding\r\nof the rules pertaining to REAC as well as the entire inspection process.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">This should be mandatory attendance for\r\nanyone involved in property management. This is an important inspection and you\r\nshould learn what needs to be done in preparation for the inspection, what the\r\nrules are for correcting deficiencies and the time lines involved.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">What\r\nWill You Achieve?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">REAC is undergoing many\r\nchanges and this course will provide the latest updates. The new rulings with NSPIRE\r\nare discussed in detail.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">Who\r\nShould Attend?</span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Owners</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Property managers</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Maintenance staff</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Housing Authorities</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Compliance Staff</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Developers</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\"><o:p>&nbsp;</o:p></span></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi\">Paul has been involved in the\r\nreal estate industry for the past 38 years. He has been involved in sales,\r\nconstruction, project management, appraisal, mortgage consulting and brokerage,\r\nproperty management and property management consulting/training.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi\">Through his consulting\r\ncompany, Property Management Solutions, he provides training and consulting\r\nservices nationwide to owners, management companies, multi-housing\r\nassociations, as well as state and federal agencies.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi\">He specializes in fair\r\nhousing issues and has developed fair housing and outreach programs for\r\ngovernmental agencies as well as conducting seminars which are presented to\r\nproperty management companies, apartment associations and the general public.\r\nHe also conducts research analysis for impediments to fair housing for grantees\r\nof federal CDBG funds.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi\">Most recently, he has been a\r\nconsultant to the City of Sioux Falls and the State of South Dakota. In this\r\nassignment he has developed a fair housing awareness program that is one of the\r\nfirst of its kind in the nation. It involves a three pronged approach to fair\r\nhousing awareness. This approach makes use of an ombudsman concept and has\r\nproven to be very effective in dealing with discrimination and landlord/tenant\r\nissues.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;\r\nmso-fareast-language:EN-US;mso-bidi-language:AR-SA\">For over twenty years was\r\ninvolved in appraisal of residential, multi-family, farm and commercial\r\nproperties throughout the Midwest. Most recently, he was a consultant for\r\naffordable, multi-housing properties in 22 different states. This involved\r\nproperties in HUD, Rural Development, HOME and Tax Credit programs.</span><br></p>', '<p>NA</p>', 1, '2020-10-15 14:44:29', '2020-12-09 00:21:21', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(51, '75f4b93d-f676-4a21-8d5f-749ec27a7a20', 1, '0', 1, 3, 'documentation-changes-for-office-visits-2021', 'Documentation Changes for Office Visits 2021', 'Lynn M. Anderanin-CPC', 'products/speaker//speaker_152823.jpg', 'products//products_124200.jpg', 159.00, '2020-11-17 13:00:00', '60', '<p align=\"center\" style=\"margin: 0in 0in 0.0001pt; text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Documentation\r\nChanges for Office Visits 2021<o:p></o:p></span></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Summary:<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">It\r\nhas been almost 30 years since the documentation guidelines for office and\r\noutpatient visits were written.&nbsp; As part\r\nof the Patients Over Paperwork Act these outdated guidelines are being retired\r\nand the American Medical Association (AMA) and the Center for Medicare and\r\nMedicaid Services (CMS) have created new guidelines that go into effect for\r\ndates of service beginning January 1, 2021<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Session highlights:<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Codes that are added\r\nand deleted for office and outpatient visits<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Changes to choosing\r\nthe level of service based on time<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">The 3 revised elements\r\nof medical decision making<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">The new role of\r\nhistory and examination<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">New ways to give\r\nproviders credit for diagnostic testing<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Tips on what your\r\noffice should do for compliance<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Educating the\r\nproviders in your office on the changes<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">What your EHR vendor\r\nshould be offering for templates<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:3.0pt;margin-left:.25in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:11.5pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#333333\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Prolonged service code\r\nchanges to capture all of the time spent for the encounter<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Benefits of attending\r\nsession:<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">You\r\nwill learn what the differences are between the current and new guidelines in\r\norder to realize the appropriate documentation for office and outpatient\r\nvisits.&nbsp; This will be critical because\r\nall insurance companies will recognize these guidelines printed in CPT® 2021.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">What will you achieve?<o:p></o:p></span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">You will be able to\r\nrecognize what changes have to be made in the documentation of your providers\r\ntoday and the changes that have to be made while gaining knowledge of all the\r\nelements and criteria auditors will be looking for to be compliant.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">&nbsp;</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\">Who should attend?</span></u></b></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><u><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;color:#333333\"><br></span></u></b><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">All specialties</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">billers</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">coders</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">reimbursement\r\nspecialists</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">prior authorization\r\nassistants</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">physicians</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Nursing Professionals</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Physician Assistants</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers</span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Administrators</span></p><p><br></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Lynn Anderanin, CPC, CPPM, CPMA, CPC-I, COSC,\r\nis the Sr. Coding Educator for Healthcare Information Services, a physician’s\r\nrevenue cycle management company in Chicago. She has over 35 years’ experience\r\nin all areas of the physician practice, specializing in Orthopaedics.&nbsp; Lynn is currently a Workshop and Audio\r\nPresenter. She is a former member of the American Academy of Professional\r\nCoders (AAPC) National Advisory Board, as well as several other boards for the\r\nAAPC. She is also the founder of her Local Chapter of the AAPC.<o:p></o:p></span></p>', '<p>Applied for CEU</p>', 1, '2020-10-21 13:53:11', '2020-12-09 00:20:48', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(52, '5824bb07-a6b7-4458-b363-37a8056919a2', 1, '0', 5, 3, 'overview-of-compliance-training-for-leaders-what-are-9-compliance-training-topics-for-leaders', 'Overview of Compliance Training for Leaders! What are 9 Compliance Training Topics for Leaders? (Boot Camp-Session 1)', 'Margie Faulk - PHR, SHRM-CP', 'products/speaker//speaker_532074.jpg', 'products//products_315199.jpg', 159.00, '2020-12-17 13:00:00', '90', '<p class=\"MsoNormal\" align=\"center\" style=\"margin-top: 15px; margin-bottom: 0.0001pt; line-height: normal; text-align: center;\"><br></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: center;\"><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif;\">Overview of Compliance Training for Leaders! What are 9 Compliance Training Topics for Leaders?</span></span><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Overview:</span></span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Have All Your Leaders be Aware of all the Compliance Risks and How to mitigate them! This Compliance Training will save your company over $300,000 in potential fines, violation and court settlements. Can you see how you can mitigate risk when you train your Leaders? Can you afford to lose $300,000 plus?</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">How many Leaders and Supervisors are training to be Leaders or leaders? Many Leaders are promoted because they are good at what they do but do not know how to manage employees. Did you know, your Leaders have the power and the authority to make the decisions that will either ruin your company or improve it? Leaders can be Ambassadors for your organizations providing leadership skills, mentorship and guidance to employees or provide increased risk and potential violations that can cost your company and the Leaders litigation and fines &amp; penalties for decisions they make through Vicarious Liability.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Vicarious Liability is when your Leaders are held accountable and responsible for their actions as Leaders. Not only is the company held responsible financially, but Leaders can also be liable for fines and penalties based on the decisions they make.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">Not all decisions Leaders make are good decisions or exemplify what the company would decide. Can you vouch for all your Leaders? Even good Leaders can cost the company thousands of dollars when they make decisions that impact the bottom line.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">9 Compliance Landmines for Leaders</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Hiring</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Family Medical Leave Act (FMLA)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Leadership Style (Managing Direct Reports)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employee Classification</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">American with Disabilities (ADA) and Reasonable Accommodation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Documentation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Performance Evaluation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Equal Employment Opportunity Commission (EEOC) &amp; Discriminatory Practices</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify; margin-left: 25px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Termination</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"font-weight: 600;\"><span style=\"font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What Will You Learn?</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Family Medical Leave Act (FMLA)\r\nand how HR/Leaders and Leaders can be a risk if they are not trained on how\r\nthey should handle employees who are eligible or not eligible</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Hiring Practices that are\r\nrequired by Employers and state specific regulations</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Vicarious Liability and how HR\r\nprofessional and Leaders can impact the Employer’s liability because they are\r\nagents of the Employers</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How can\r\nregular supervision limit the bad performance issues with direct reports?</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&