ent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employers</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Managers/Supervisors</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Potential Managers/Supervisors</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Executives</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Compliance professionals</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Business owners</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; text-align: justify;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Professionals who handle employee relations issues</span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 11.5pt; line-height: 17.6333px; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><br></p><p style=\"box-sizing: border-box; outline: none !important; padding: 0px; margin: 15px 0px 0px; line-height: 1.6;\"></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie Faulk is\r\na senior level human resources professional with over 15 years of HR management\r\nand compliance experience. A current Compliance Advisor for HR Compliance\r\nSolutions, LLC, Margie, has worked as an HR Compliance advisor for major\r\ncorporations and small businesses in the small, large, private, public,\r\nNon-profit sectors and International compliance.&nbsp; Margie has provided small to large businesses\r\nwith risk management strategies that protect companies and reduces potential\r\nworkplace fines and penalties from violation of employment regulations. Margie\r\nis bilingual (Spanish) fluent and Bi-cultural.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie’s area\r\nof expertise includes Criminal Background Screening Policies and auditing, I-9\r\ndocument correction and storage compliance, Immigration compliance, employee\r\nhandbook development, policy development, sexual harassment\r\ninvestigations/certified training, SOX regulations, payroll compliance,\r\ncompliance consulting, monitoring US-based federal, state and local\r\nregulations, employee relations issues, internal investigations, HR management,\r\ncompliance consulting, internal/external audits, and performance management.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\">Margie holds professional human resources certification (PHR) from the\r\nHR Certification Institution (HRCI) and SHRM-CP certification from the Society\r\nfor Human Resources Management. Margie is a member of the Society of Corporate\r\nCompliance &amp; Ethics (SCCE).</span><br></p>', '<p><span style=\"color: rgb(119, 119, 119); font-size: 14px;\">1.5 SHRM-CP Credits</span><br></p>', 1, '2020-11-09 23:12:31', '2021-01-26 14:03:55', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(53, '6e420b2d-08d1-4001-972d-568f52bbc554', 1, '0', 5, 3, 'multi-state-regulations-for-2021', 'Multi-State Regulations for 2021 (Boot Camp-Session 2)', 'Margie Faulk - PHR, SHRM-CP', 'products/speaker//speaker_356903.jpg', 'products//products_587241.jpg', 159.00, '2020-12-17 15:00:00', '90', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><u style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 15.3333px; font-weight: 600;\"><br></u></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Helvetica\">Multi-State Regulations for 2021</span></b><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Overview:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Many Employers do not realize that the changes in their state\r\nregulations have an impact on state specific and multi-state locations and\r\nespecially with remote employees. Now more than ever Employers, Leaders, HR\r\nprofessionals, and Managers need to be prepared for the changes that impact\r\nemployees and communicate changes to employees. Training is the best method to\r\nkeep track of workplace changes and how to create an effective risk management\r\nstrategy. At this time over 35 states have workplace changes. It is critical to\r\nbe informed since ignorance is no excuse for non-compliance. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Labor research has proven that Employers have a delay in\r\nimplementing new regulations and adding it to Employee Handbooks or stand-alone\r\npolicies. Moreover, new regulations go hand in hand with employee handbook and\r\nstandalone policies updates. As a compliance officer, I am always providing\r\nsupport to Employers and professionals and see what the gaps are when\r\nprotecting employees. Federal, State, and local regulations have an impact in\r\nmaintaining workplace compliance and Employers need to be aware that when\r\nFederal, State and Local regulations clash the regulations with the most\r\nbenefit for the employees supersedes. That is why it is important to be aware\r\nand follow all workplace regulations.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">More changes in regulations were passed in July 2020 and more expected\r\nin 2021 in different states and Employers must ensure they are ready to\r\naccommodate the regulations that have changed in those states.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You Learn?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nFederal regulations are in place for 2020?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nState regulations have been in place since January 1, 2020 and Employers were\r\nnot aware?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nregulations have been implemented in July 2020 &amp; 2021 and in which states?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nstates have had the most changes in employment regulations?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What are\r\nthe regulations with the most fines?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nregulations are the most consistent across all changes?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nregulations must be added to Employee Handbooks or stand alone policies to\r\nensure workplace compliance?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nEmployee centric (employee friendly) regulations are consistent with certain\r\nstates?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quo