or:#333333\">Attendees will have an overview of the trending multi-state\r\nregulations and the impact to Employers and professionals. They will also learn\r\nhow to manage the multi-state regulations and how to access resources that will\r\nassist them in mitigation.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Who Should Attend?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><ul style=\"margin-top:0in\" type=\"disc\">\r\n <li class=\"MsoNormalCxSpFirst\" style=\"color:#333333;margin-bottom:0in;\r\n     margin-bottom:.0001pt;mso-add-space:auto;line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">All Employers with\r\n     multi-state locations<o:p></o:p></span></li>\r\n <li class=\"MsoNormalCxSpMiddle\" style=\"color:#333333;margin-bottom:0in;\r\n     margin-bottom:.0001pt;mso-add-space:auto;line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Employers with\r\n     remote/telecommuting employees in multi-state locations<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Business Owners<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Company Leadership<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Compliance professionals<o:p></o:p></span></li>\r\n <li class=\"MsoNormalCxSpMiddle\" style=\"color:#333333;mso-margin-top-alt:auto;\r\n     mso-margin-bottom-alt:auto;mso-add-space:auto;line-height:normal;\r\n     mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Payroll\r\n     Administrators<o:p></o:p></span></li>\r\n <li class=\"MsoNormalCxSpMiddle\" style=\"color:#333333;mso-margin-top-alt:auto;\r\n     mso-margin-bottom-alt:auto;mso-add-space:auto;line-height:normal;\r\n     mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">HR\r\n     Professionals<o:p></o:p></span></li>\r\n <li class=\"MsoNormalCxSpMiddle\" style=\"color:#333333;mso-margin-top-alt:auto;\r\n     mso-margin-bottom-alt:auto;mso-add-space:auto;line-height:normal;\r\n     mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Managers/Supervisors<o:p></o:p></span></li>\r\n <li class=\"MsoNormalCxSpMiddle\" style=\"color:#333333;mso-margin-top-alt:auto;\r\n     mso-margin-bottom-alt:auto;mso-add-space:auto;line-height:normal;\r\n     mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\n     mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Employers\r\n     in all industries<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Small Business Owners</span></li><li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"text-align: justify; text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif;\">Large Business Owners</span></li></ul><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\">\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt; text-align: justify;\">&nbsp;</span><br></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><br></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie Faulk is\r\na senior level human resources professional with over 15 years of HR management\r\nand compliance experience. A current Compliance Advisor for HR Compliance\r\nSolutions, LLC, Margie, has worked as an HR Compliance advisor for major\r\ncorporations and small businesses in the small, large, private, public,\r\nNon-profit sectors and International compliance.&nbsp; Margie has provided small to large businesses\r\nwith risk management strategies that protect companies and reduces potential\r\nworkplace fines and penalties from violation of employment regulations. Margie\r\nis bilingual (Spanish) fluent and Bi-cultural.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie’s area\r\nof expertise includes Criminal Background Screening Policies and auditing, I-9\r\ndocument correction and storage compliance, Immigration compliance, employee\r\nhandbook development, policy development, sexual harassment\r\ninvestigations/certified training, SOX regulations, payroll compliance,\r\ncompliance consulting, monitoring US-based federal, state and local\r\nregulations, employee relations issues, internal investigations, HR management,\r\ncompliance consulting, internal/external audits, and performance management.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\">Margie holds professional human resources certification (PHR) from the\r\nHR Certification Institution (HRCI) and SHRM-CP certification from the Society\r\nfor Human Resources Management. Margie is a member of the Society of Corporate\r\nCompliance &amp; Ethics (SCCE).</span><br></p>', '<p>1.5 SHRM-CP Credits</p>', 1, '2020-11-09 23:43:25', '2021-01-26 14:02:32', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(54, '8db3da2b-ede5-488e-80cf-d03d36f6d72c', 1, '0', 5, 3, 'errors-leaders-make-on-workplace-issues-and-how-to-fix-them', 'Errors Leaders Make on Workplace Issues and How to Fix Them! (Boot Camp-Session 3)', 'Margie Faulk - PHR, SHRM-CP', 'products/speaker//speaker_152031.jpg', 'products//products_366725.jpg', 159.00, '2020-12-18 13:00:00', '90', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Helvetica\"><br></span></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Helvetica\">Errors Leaders Make on Workplace Issues and How\r\nto Fix Them!</span></b><br></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Overview:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Whether you are an office manager or a project leader, all good\r\nleaders require a number of&nbsp;<a href=\"https://www.thebalancecareers.com/what-are-soft-skills-2060852\"><span style=\"color: rgb(51, 51, 51);\">skills</span></a>&nbsp;to\r\nhelp them positively interact with employees or team members. Effective leaders\r\nhave the ability to communicate well, motivate their team, handle and delegate\r\nresponsibilities, listen to feedback, and have the flexibility to solve\r\nproblems in an ever-changing workplace.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Being a leader comes with a host of responsibilities, including\r\nhandling workplace issues and setting a good example. You\'re often held to high\r\nexpectations as the person in charge, and managing an entire team of people can\r\nbe intimidating.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Good Leadership is an important element in the success of any\r\norganization. Having effective&nbsp;<a href=\"https://richardvanhooijdonk.com/blog/en/leaders-of-the-21st-century-shouldnt-play-boss/\" target=\"_blank\" title=\"Leaders\"><span style=\"color: rgb(51, 51, 51);\">leaders</span></a>&nbsp;can help a company achieve its\r\ngoals and maximize efficiency. In most cases, leaders have a profound influence\r\non their employees. Besides helping them better handle workplace-related\r\nchallenges, leaders evoke innovation and creativity and inspire them to reach\r\ntheir full potential.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">There’s been a lot of debate on whether leadership skills can be\r\nacquired in life or the person must be born with them. The answer is both.\r\nThere are some people who seem to be born with great leadership skills, as well\r\nas those who developed them later in life. To encourage employees to become\r\nmore innovative, leaders need to pay attention to a number of issues. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">However, no one is perfect; there is always room to learn and\r\ngrow, and to help your employees do the same. Here are 9 common mistakes that\r\nmany leaders struggle with and how to fix them.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">9 Mistakes Leaders\r\nMake</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Treating\r\nEmployees Like Friends!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Not Following\r\nEmployee Handbooks of Policies!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Not Conducting\r\nProper Background Screening According to Current and New Regulatory Guidelines!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: 