pan style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Failing\r\nto Discipline Employees at All or Consistently!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Failing\r\nto Attend Sexual Harassment Training</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Not\r\nReaching Out to HR Professionals Prior to an Incident!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Terminating\r\nEmployees Prematurely or Before Reviewing the Impact!</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Micromanaging-Bonus</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You Learn?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employers\r\nwho train their Leaders/Supervisors in compliance initiatives, have a “good\r\nfaith Defense” if there are future workplace litigations;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Leaders/Supervisors\r\nmake decision that does not necessarily coincide with the Organization. This Compliance\r\nTraining Series will mandate your Leaders/Supervisors to follow your\r\norganization’s policies, culture and practice;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Your\r\nOrganization can demonstrate that they provide good judgment when litigation\r\nissues arise. That means if the Organization can demonstrate that they train\r\nLeaders/Supervisors, they will prove that they train for success;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Teach\r\nLeaders/Supervisors the most volatile issues that they will face as Leaders and\r\nhow to mitigate those issues;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Teach\r\nLeaders/Supervisor how to handle performance issues consistently and according\r\nto your Organization’s values and mission;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Documentation\r\nis key in performance issues. Have your Leaders/Supervisors learn how to\r\ndocument performance consistently, strategically and fairly;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Benefits for\r\nAttending:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how to identify the most\r\nimpactful Leadership errors Leaders make and how to manage them</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how to avoid errors that\r\nwill impact compliance efforts</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will enhance your knowledge on ways\r\nto increase risk strategies</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how the best Leaders will\r\nretain employees</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn what the most effective\r\ntraining method can ensure compliance</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">SHRM Recertification PDU Credits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free customized compliance tools in the\r\nform of guides, templates, policies, and toolkits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Additional HR Compliance Supplemental\r\nSlides</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free answer to all questions even after\r\nthe training ends</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You\r\nAchieve?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-bidi-language:EN-US\">This training will outline the mistakes\r\nthat Leaders make and how to fix them. Fortunately, one of the key factors in\r\ngood leadership is training, training, Training! I have identified 9 of the\r\nmost impactful errors Leaders make but there are several more. The focus will\r\nbe on why these errors impact the workplace and how to ensure Leaders will\r\nlearn and change their leadership styles before they violate any regulations\r\nand land their Employers and themselves in litigation.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Who Should Attend?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><ul style=\"margin-top:0in\" type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Human Resources professionals<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Employers<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Leaders/Supervisors<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Current Leaders<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Potential Leaders/Supervisors<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Executives<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;\r\n     font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n     mso-bidi-font-family:Helvetica\">Compliance professionals<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     text-align:justify;line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Business owners<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"color:#333333;margin-bottom:0in;margin-bottom:.0001pt;\r\n     text-align:justify;line-height:normal;mso-list:l1 level1 lfo3\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n     &quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica\">Professionals who handle\r\n     employee relations issues<o:p></o:p></span></li>\r\n</ul><p class=\"MsoNormal\" style=\"text-align:justify\"><br></p>', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie Faulk is\r\na senior level human resources professional with over 15 years of HR management\r\nand compliance experience. A current Compliance Advisor for HR Compliance\r\nSolutions, LLC, Margie, has worked as an HR Compliance advisor for major\r\ncorporations and small businesses in the small, large, private, public,\r\nNon-profit sectors and International compliance.&nbsp; Margie has provided small to large businesses\r\nwith risk management strategies that protect companies and reduces potential\r\nworkplace fines and penalties from violation of employment regulations. Margie\r\nis bilingual (Spanish) fluent and Bi-cultural.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Margie’s area\r\nof expertise includes Criminal Background Screening Policies and auditing, I-9\r\ndocument correction and storage compliance, Immigration compliance, employee\r\nhandbook development, policy development, sexual harassment\r\ninvestigations/certified training, SOX regulations, payroll compliance,\r\ncompliance consulting, monitoring US-based federal, state and local\r\nregulations, employee relations issues, internal investigations, HR management,\r\ncompliance consulting, internal/external audits, and performance management.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\">Margie holds professional human resources certification (PHR) from the\r\nHR Certification Institution (HRCI) and SHRM-CP certification from the Society\r\nfor Human Resources Management. Margie is a member of the Society of Corporate\r\nCompliance &amp; Ethics (SCCE).</span><br></p>', '<p>1.5 SHRM-CP Credits</p>', 1, '2020-11-09 23:57:57', '2021-01-26 14:00:11', NULL);
INSERT INTO `product` (`id`, `uuid`, `product_type`, `package_credit`, `category_id`, `type`, `url_name`, `title`, `speaker_name`, `speaker_picture`, `picture`, `price`, `webinar_date_time`, `duration`, `overview`, `speaker`, `ceus`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(55, 'da36b909-cd7c-4d2d-9984-491850e99fb2', 1, '0', 5, 3, 'hr-compliance-2020-2021-virtual-boot-camp-45-hr-shrm-credits', 'HR Compliance 2020-2021 Virtual Boot Camp (4.5-hr/2 Days Live Webinar )', 'Margie Faulk - PHR, SHRM-CP', 'products/speaker//speaker_932923.jpg', 'products//products_164822.jpg', 299.00, '2020-12-17 13:00:00', '270', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><u><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\"><br></span></u></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><u><span style=\"font-size:14.0pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;\">HR\r\nCompliance 2020-2021 Virtual Boot Camp</span></u></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"color: rgb(51, 51, 51); font-family: Helvetica, sans-serif; font-size: 11.5pt;\">&nbsp;</span><br></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;\">Session 1: </span><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\nHelvetica\"><b>Overview of Compliance Training for Leaders! What are 9 Compliance\r\nTraining Topics for Leaders?</b></span><b><span style=\"font-size:11.5pt;line-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\">\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><b><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:Helvetica;color:#333333\">Date &amp; Time: 17</span></b><b><span style=\"font-size:11.5pt;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;\"><sup>th</sup> Dec 2020 (1:00 pm est) 90 min<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Overview:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Have All Your Leaders be Aware of all the Compliance Risks and\r\nHow to mitigate them! This Compliance Training will save your company over\r\n$300,000 in potential fines, violation and court settlements. Can you see how\r\nyou can mitigate risk when you train your Leaders? Can you afford to lose\r\n$300,000 plus?<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">How many Leaders and Supervisors are training to be Leaders or\r\nleaders? Many Leaders are promoted because they are good at what they do but do\r\nnot know how to manage employees. Did you know, your Leaders have the power and\r\nthe authority to make the decisions that will either ruin your company or\r\nimprove it? Leaders can be Ambassadors for your organizations providing\r\nleadership skills, mentorship and guidance to employees or provide increased\r\nrisk and potential violations that can cost your company and the Leaders\r\nlitigation and fines &amp; penalties for decisions they make through Vicarious\r\nLiability. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Vicarious Liability is when your Leaders are held accountable\r\nand responsible for their actions as Leaders. Not only is the company held\r\nresponsible financially, but Leaders can also be liable for fines and penalties\r\nbased on the decisions they make. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Not all decisions Leaders make are good decisions or exemplify\r\nwhat the company would decide. Can you vouch for all your Leaders? Even good\r\nLeaders can cost the company thousands of dollars when they make decisions that\r\nimpact the bottom line.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">9 Compliance\r\nLandmines for Leaders</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Hiring</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Family Medical Leave Act (FMLA)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Leadership Style (Managing Direct Reports)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employee Classification</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">American with Disabilities (ADA) and Reasonable Accommodation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Documentation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Performance Evaluation</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Equal Employment Opportunity Commission (EEOC) &amp;\r\nDiscriminatory Practices</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal; margin-left: 50px;\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Termination</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You Learn?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Family Medical Leave Act (FMLA)\r\nand how HR/Leaders and Leaders can be a risk if they are not trained on how\r\nthey should handle employees who are&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; eligible or not eligible</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Hiring Practices that are\r\nrequired by Employers and state specific regulations</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Vicarious Liability and how HR\r\nprofessional and Leaders can impact the Employer’s liability because they are\r\nagents of the Employers</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How can\r\nregular supervision limit the bad performance issues with direct reports?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">How can a\r\ngood onboarding process ease the issues of good acclimation to the\r\nOrganization’s culture?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\ntools can Leaders/Supervisors have to assist them in managing their teams?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">What\r\nhappens when an employee is terminated and they make claims of wrongful\r\ntermination?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">When\r\nLeaders/Supervisors are not acting as Leaders but trying to be a friend to\r\ntheir direct reports?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">See what\r\ntools will help your Leaders/Supervisors during the performance review\r\nevaluation period;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Teach Leaders/Supervisors how they can\r\nmanage their employees and reduce violations.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Benefits for\r\nAttending:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how to document performance issues to withstand\r\nlegal scrutiny.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how Leaders/Supervisors take the lead in managing\r\ntheir direct reports.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how an effective Employee Manager relationship\r\ncan reduce your risk and improve productivity;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn how will Family Medical Leave Act (FMLA) and\r\nAmericans with Disabilities Act (ADA) impact your bottom line if there are\r\nperformance issues;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will learn what the Equal Employment Opportunity Commission\r\n(EEOC) does when there is a claim of discrimination.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You learn how leaders assist their direct reports as mentors and\r\nadvisors?</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">SHRM Recertification PDU Credits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free customized compliance tools\r\nin the form of guides, templates, policies, and toolkits</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Additional HR Compliance\r\nSupplemental Slides</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Free answer to all questions even\r\nafter the training ends</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You\r\nAchieve?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will be able to create a Leadership strategy to mitigate\r\ncompliance</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will be able to training leaders to be knowledgeable of the\r\nrisk they take when managing employees</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">You will be able to provide guidance as a leader to decrease the\r\npotential for fines, penalties and criminal sanctions</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\"><br></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;\">Session 2: </span><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><b>Multi-State\r\nRegulations for 2021</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal\"><b><span style=\"font-size:11.5pt;\r\nfont-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:Helvetica;color:#333333\">Date &amp; Time: 17</span></b><b><span style=\"font-size:11.5pt;font-family:\r\n&quot;Helvetica&quot;,&quot;sans-serif&quot;\"><sup>th</sup> Dec 2020 (3:00 pm est) 90 min<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.5pt;\r\nline-height:115%;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">Overview:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Many Employers do not realize that the changes in their state\r\nregulations have an impact on state specific and multi-state locations and\r\nespecially with remote employees. Now more than ever Employers, Leaders, HR\r\nprofessionals, and Managers need to be prepared for the changes that impact\r\nemployees and communicate changes to employees. Training is the best method to\r\nkeep track of workplace changes and how to create an effective risk management\r\nstrategy. At this time over 35 states have workplace changes. It is critical to\r\nbe informed since ignorance is no excuse for non-compliance. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">Labor research has proven that Employers have a delay in\r\nimplementing new regulations and adding it to Employee Handbooks or stand-alone\r\npolicies. Moreover, new regulations go hand in hand with employee handbook and\r\nstandalone policies updates. As a compliance officer, I am always providing\r\nsupport to Employers and professionals and see what the gaps are when\r\nprotecting employees. Federal, State, and local regulations have an impact in\r\nmaintaining workplace compliance and Employers need to be aware that when\r\nFederal, State and Local regulations clash the regulations with the most\r\nbenefit for the employees supersedes. That is why it is important to be aware\r\nand follow all workplace regulations.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">More changes in regulations were passed in July 2020 and more expected\r\nin 2021 in different states and Employers must ensure they are ready to\r\naccommodate the regulations that have changed in those states.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;\r\ncolor:#333333\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\">What Will You Learn?</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><b><span style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Helvetica;color:#333333\"><br></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; line-height: 115%; font-fam