ations.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Gain knowledge of how regulatory agencies impact multi-state law</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn how to mitigate and maintain all the changes in\r\nmulti-state regulations</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span style=\"text-indent: -0.25in; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn how to manage the multi-state laws in your employee\r\nhandbooks</s