lor:#333333\">While\r\nthe nation waits for the New Administration to start making changes in focus\r\nfor the workplace, it is imperative to understand what the forecast tells us and\r\nhow Employers and Professionals can prepare. The new agenda for the workplace\r\nby the President and Vice-President elect, will shift some of the regulations\r\nfrom the previous administration but, we have received information on what\r\nchanges are expected for 2021.<o:p></o:p></span></p><p style=\"margin: 0cm; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Employers should\r\nreview the proposed changes and see how it impact their industry, Federal state,\r\nand local regulations. They will need to make the changes in their policies and\r\nEmployee Handbook. Employees need for Employers to prepare and communicate any\r\nchanges effectively. The changes will impact the budget and compliance efforts\r\nmay need to be adjusted. Training will be a huge factor to communicate any\r\nchanges in the focus for Employers.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><b><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">Why Should You Attend:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\">Regulatory Agencies\r\nare preparing for what they consider changes in regulations and focus on a\r\nchange in compliance efforts. Violations of regulation will take center stage\r\nand there will be a scramble to make announcements of the changes. The list of\r\nagenda items from this training will provide Employers with what and how the\r\nchanges will impact them.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#333333\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><b><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\">What Will You Learn:</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><b><span lang=\"EN-US\" style=\"font-size:11.5pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#333333\"><br></span></b><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn what the New Administration perspective is on how they\r\nwill impact the workplace.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn what the workplace priority is and how they plan to implement\r\nthose priorities.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn what regulatory agencies are impacted the most.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Learn how the 15 workplace changes are and how they were selected.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Workplace safety</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Pay Equity</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Corona Virus Protection Initiatives and State Funds for Small\r\nBusiness</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Wage and Hour Increase in Hourly Rate</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Helvetica, sans-serif; color: rgb(51, 51, 51);\">Employee Classification</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\nnormal\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 11.5pt; font-family: Symbol; color: rgb(51, 51, 51);\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;